INSERT INTO `mdl_local_teaching_survey` VALUES (10056,1605675600,'Tangipahoa Parish, LA','Teacher or specialist',4,4,4,4,4,4,'We haven\'t discussed remote/hybrid learning much.','Scaffolding to help students understand complex texts.',4,4,4,0,0,'The experientials','Focusing more on grade-level texts in groups.  Feels like we are jumping to all sorts of different guidebook units as discussion tools.',9,'It\'s a good training.','',1,1,0,0,0,'Experientials'),(10057,1605675600,'Tangipahoa Parish, LA','Teacher or specialist',4,3,4,5,4,4,'The introduction to the Nearpod platform was very helpful.','Close-reading strategies',4,4,4,4,4,'The interactive virtual activities to check for understanding were strong.','',8,'The course and information were mostly helpful. I think at times some of the concepts are redundant but that can also serve to reinforce the material to a degree.','',1,1,2,0,0,'Acting as a student while the facilitator took on the teacher role for example activities that we may complete in class.'),(10058,1605675600,'Tangipahoa Parish, LA','Teacher or specialist',5,5,5,5,5,5,'N/A','Reading Circle',5,5,5,0,0,'Content Delivery & discussion','Breakout Room 2nd activity was a bit convoluted ',10,'Facilitator has a professional, gentle approach coupled with great content','N/A',1,1,0,0,0,'Guidebooks annotation'),(10059,1605675600,'Tangipahoa Parish, LA','Teacher or specialist',1,1,1,1,1,1,'0%','nothing',1,1,1,0,0,'nothing','nothing',0,'it is useless to me professionally','no',1,1,0,0,0,'nothing'),(10060,1605675600,'Tangipahoa Parish, LA','Teacher or specialist',2,3,2,1,3,1,'','',3,2,2,0,0,'','',0,'','',1,1,0,0,0,''),(10061,1605589200,'Nebraska Innovation Network Fellowship','District/network/state-level professional or administrator',4,4,2,4,4,1,'Actual suggestions for student engagement','How important a shared vision is',3,3,4,3,3,'less things to do stuff to keep open','need to check out the Moodle ',7,'','',2,3,4,0,0,'listening to small groups'),(10062,1605589200,'Nebraska Innovation Network Fellowship','District/network-based coach or Curriculum and instruction specialist',4,5,3,5,4,2,'','Focusing on the selection, implementation and PL around HQIM. Loved the discussion about vision tonight',5,4,4,5,5,'working with the other district.','',10,'','',2,5,3,0,0,'Same'),(10063,1605589200,'Nebraska Innovation Network Fellowship','School-based administrator or supervisor',4,4,4,4,4,2,'','I have several staff members that join from home/their classrooms instead of attending meetings/PD in a large group.  I would like to try using Moodle and/or Nearpod.',4,4,4,3,3,'I liked talking to other individuals and schools.  They were very helpful.','It is overwhelming at times for me to be on so many platforms at the same time and I feel lost at times.',7,'Because it is relevant to my needs for curriculum adoption.','',2,4,5,0,0,'discussion'),(10064,1605589200,'Nebraska Innovation Network Fellowship','School-based coach',3,4,4,4,4,3,'','',5,4,3,0,0,'','',7,'Still learning about the process and learning to following along where everyone else is at.','',2,3,0,0,0,''),(10065,1605589200,'Nebraska Innovation Network Fellowship','District/network-based coach or Curriculum and instruction specialist',3,5,3,4,4,1,'','How to best support teachers after adoption',3,4,4,4,4,'Time in break out rooms','Focus/Follow up on our asynchronous work',8,'Still early in the process.  Eager to see what lies ahead','More time included at the end to complete this survey.  ',2,4,3,0,0,''),(10066,1605589200,'Nebraska Innovation Network Fellowship','District/network/state-level professional or administrator',4,4,4,4,4,4,'Districts shared the inequities that have been exposed and the wish to improve because of COVID-19','Developing content specific guidance around HQIM selection.',5,5,5,0,0,'Time to collaborate with other districts.','Shorten this survey.',8,'It\'s nice listening to district leaders.','',2,3,0,0,0,'Breakout sessions using Teaching Lab prompts. '),(100