ng how these techniques build equity for all ','more ways to engage students virtually ',9,'','',3,1,6,0,0,'talking it out with teammates '),(10087,1605589200,'Louisville School District - Jacob Elementary, KY','Teacher or specialist',3,4,4,3,4,2,'','Red, Yellow, Green ',5,3,4,2,3,'Time to look at protocols with my team. ','More time to work, clearer directions, receiving the prework earlier. ',5,'It could have been more engaging. ','None ',3,1,6,0,0,'Discussing how we would implement the TPT and protocol virtually. '),(10088,1605589200,'Louisville School District - Jacob Elementary, KY','Teacher or specialist',4,2,2,3,4,4,'N/A','Collaborating with gen. ed. teachers',1,4,4,4,4,'Synchronous calls','N/A',8,'I believe this is a good curriculum for gen. ed. teachers to implement','N/A',3,1,6,0,0,'Breakout rooms with grade level'),(10089,1605589200,'Louisville School District - Jacob Elementary, KY','Teacher or specialist',5,3,5,5,5,5,'more options to explore','How to navigate EL',5,5,5,5,5,'','',10,'','',3,1,6,0,0,''),(10090,1605589200,'Louisville School District - Jacob Elementary, KY','Teacher or specialist',4,4,5,4,4,4,'Other ways to be flexible with EL to support student learning','chalk talk',4,5,5,5,5,'time to collab with team and try new protocols and TPTs','more time to dig deeper',10,'I feel confident that I can incorporate what I have learned','keep rocking it out',3,1,6,0,0,'when we looked at things through a student\'s lens'),(10091,1605589200,'Louisville School District - Jacob Elementary, KY','Teacher or specialist',5,5,5,5,5,5,'','TPTs',5,5,5,5,5,'','',10,'','',3,1,6,0,0,''),(10092,1605589200,'OTHER','School-based administrator or supervisor',4,2,4,4,5,4,'','The implementation of protocols ',3,5,5,5,5,'','',8,'','',3,1,6,0,0,''),(10093,1605589200,'Louisville School District - Jacob Elementary, KY','Teacher or specialist',4,4,4,4,4,2,'','Trying different protocols.',4,4,4,4,4,'','',7,'','',3,1,6,0,0,''),(10094,1605589200,'Louisville School District - Jacob Elementary, KY','School-based coach',5,5,5,5,5,4,'','TPT\'s',5,5,5,4,4,'The engagement strategies the presenters used','To focus more on how to use TPT\'s effectively in a virtual setting',9,'I think if you are implementing a new curriculum such as EL, to be able to do it effectively you need to receive professional learning from the experts.','',3,1,6,0,0,'The interactive learning provided through using NearPod'),(10095,1605589200,'Louisville School District - Jacob Elementary, KY','Teacher or specialist',5,5,5,5,5,3,'','Gallery Walk',5,5,5,5,5,'','',7,'','',3,1,6,0,0,''),(10096,1604984400,'Delaware Department of Education, DE','Teacher or specialist',5,5,5,5,5,5,'','I am excited about using the IPR with teachers as a planning guide and focusing on quality questions that will elicit student thinking around the learning goal.  I think it’s possible to infuse ways to collect student thinking, in a remote setting, that can be analyzed to shape future lessons and activities.  I like how we are focusing on the quality of teaching/learning and wonder if it may be worth while to offer future training (possibly for teachers) around creating formatives and summatives that require students to demonstrate and explain understanding of a concept.  Shifting assessments to demonstration of mastery may lead to higher quality lessons.',5,5,5,0,0,'The schedule is a perfect combination of synchronous and asynchronous learning.  I appreciate having time to work with, and discuss, new concepts.','',10,'Today’s session was extremely relevant and inclusive.  I appreciate having access to all the materials.  Everything was well organized and well executed.','Thank you for all your hard work!',4,7,0,0,0,'The breakout rooms offer great opportunities to explore ideas and receive feedback.  I am glad we are in small groups and are given a substantial amount of time for our discussions.'),(10097,1604984400,'Delaware Department of Education, DE','District/network-based coach or Curriculum and instruction specialist',5,5,5,5,5,3,'','The activity we did with labeling text-dependent or not text dependent questions. Loved this!',5,5,5,0,0,'I always have enjoyed going into our breakout rooms to collaborate with colleagues.','',10,'Great facilitators and relevant content.','',5,8,0,0,0,'The labeling of text dependent vs. not text dependent questions.'),(10098,1604984400,'Delaware Department of Education, DE','Teacher or specialist',5,5,5,5,5,4,'','Developing well-constructed text-dependent questions',5,5,5,0,0,'The breakout rooms, after having independent time to work , were helpful.  Discussing everyone\'s experiences is great!','',10,'The specific texts and sample TDQs are enlightening!','',5,8,0,0,0,'Indep/collaboration'),(10099,1604984400,'Delaware Department of Education, DE','District/network-based coach or Curriculum and instruction specialist',5,5,5,5,5,3,'','Exploring equity while using TDQ with teachers. ',3,5,5,0,0,'The ability to collaborate with others was awesome!!!  The shared resources will be used and provided much support.','',10,'This session really made you think and reflect as an educator.  It is inspiring to do better!','',5,8,0,0,0,'It was overall amazing!'),(10100,1604984400,'Delaware Department of Education, DE','School-based coach',5,5,4,4,5,3,'','I am most excited about continuing my work around the IPG Core Action1 and 3c. Since the IPG can be used to track growth I think it is important that I continue to revisit it with the teacher I am working with. ',4,4,5,0,0,'The breakout groups went well where we were able to discuss positive effects in the beginning and then sharing our problems of practice in the afternoon and getting feedback from other coaches. ','It would have been helpful to see some examples of \"dilemmas\". I might have been over thinking it, but it was difficult for me to come up with one that was not about other people changing their practice because as coaches we want our teachers to change in practice to improve student learning. Again, I might have been overthinking it. ',9,'I think there is always something from one of these sessions that someone could walk away with. ','',4,7,0,0,0,'The Consultancy protocol supported my learning because it gave me a few minutes where my \"dilemma\" was the focus and topic of conversation and I could truly walk away with ideas and possible steps to take. '),(10101,1604984400,'Delaware Department of Education, DE','District/network-based coach or Curriculum and instruction specialist',5,5,5,5,5,3,'','Training teachers on using true text dependent questions that will allow all students to engage. ',5,5,5,0,0,'Collaboration with groups- time to discuss and share- great resources','Nothing:)',10,'All relevant and necessary!','Thank you for all the work-- I am excited to use it.',5,8,0,0,0,'Comparison of TDQ and creating TDQ for a specific text with a discussion following'),(10102,1604984400,'Delaware Department of Education, DE','District/network-based coach or Curriculum and instruction specialist',4,4,4,4,4,4,'','looking at the examples of the TDQ',4,4,4,0,0,'collaboration and working on TDQ','NA',9,'Great information and resources','',5,8,0,0,0,'TDQ'),(10103,1604984400,'Delaware Department of Education, DE','School-based coach',4,3,4,4,4,4,'','The basketball poem example and the \"If\" poem activity.',3,0,0,0,0,'Morning activities. ','',7,'','',5,0,0,0,0,''),(10104,1604984400,'Delaware Department of Education, DE','School-based coach',4,4,4,4,4,3,'','Utilizing the Instructional Practice Guide to help me focus my low inference notes and conversations with teachers after a visit into their classroom.',5,5,4,0,0,'The focus within our breakout rooms.','I need to remember to get up and move during the day -- less than 500 steps today - that leaves a lot walking for the evening.',8,'This training is well organized, informative and highly connected to coaching expectations.','Thank you for helping me see the connections between this and the other DDOE coaching priorities -- It helped me realize it is not just one more thing, but another structure that I could use when working with teachers during a coaching cycle. I appreciated it and it helped alleviate some stress that I was having. I actually screen shot that slide and will be printing it out for a visual for me.',4,7,0,0,0,'The combination of both synchronous and asynchronous work.'),(10105,1604984400,'Delaware Department of Education, DE','Teacher or specialist',5,5,5,5,5,4,'','using student artifacts to determine if students are meeting the learning goal?',5,5,5,0,0,'The student work analysis  to show the evidence of understanding and unfinished learning brought out a conversation with my partner about ideas to possibly implement to help with student understanding.','Didn\'t have enough time to fully develop my action plan at the end.  Of course it is always needing more time.',7,'This training involves full commitment and a lot of time and effort as it is year long.','',4,7,0,0,0,'The consultancy protocol was useful to get feedback or suggestions on how to approach my dilemma.  Some of the clarifying questions asked made me pause and really think about my dilemma through a different lens.'),(10106,1604984400,'Delaware Department of Education, DE','School-based coach',4,5,5,4,4,3,'','I\'m still thinking about supporting admin and teachers\' professional learning, especially with respect to planning and enacting lessons that support student learning.',5,4,4,0,0,'Thank you for making the adjustments to accessing materials and being clear about the materials','I was wondering whether it might be possible to have viewable links rather than copy links to the documents?  Sometimes I just want to see the document (especially when I go back later), and having a link that requires a copy be made means I have 5-6 copies in my drive. :|  I can just delete them, and I do, but the viewable link would avoid that.  We would still need to make a copy to write on, so i