ge, SC','Teacher or specialist',5,5,5,5,5,5,'N/A','N/A',5,5,5,0,0,'N/A','N/A',5,'N/A','n/A',3,1,0,0,0,'N/A'),(10264,1604030400,'Legacy Early College, SC','Teacher or specialist',5,5,5,5,5,5,'Virtual teaching ideas ','More TPT\'s throughout the whole day, not just during EL ',5,5,5,0,0,'Moodle ','Less work to have \"turned in\" ',6,'A lot of us had already dove very deep into this curriculum, it would have been most beneficial for first years. ','N/A',3,21,0,0,0,'Articles/Research '),(10265,1603339200,'Delaware Department of Education, DE','District/network-based coach or Curriculum and instruction specialist',4,5,5,5,4,3,'','Sharing the diving deeper into using the IPG',5,4,4,0,0,'The asynchronous work block activity. ','A little more time for the asynchronous work.  I felt very rushed to complete the activity and probably would have done a better job if I had more time. ',9,'This PL would be valuable for admin, specialists, coaches, AND teachers','',13,7,0,0,0,'Using the IPG along with the sample lesson video. '),(10266,1603339200,'Delaware Department of Education, DE','Teacher or specialist',4,5,4,4,4,3,'','Utilizing the IPG',5,5,5,0,0,'Good mix of asynchronous and synchronous time  to process and reflect on Core Actions 1 and 3c along with the IPG.','I honestly needed MORE time to process and reflect on what was presented and discussed.  There was ALOT of information crammed into a short period of time and I don\'t feel that I was able to fully grasp everything.   My brain takes time to process and when I don\'t have that time, I don\'t feel as though I learn as well.',7,'I think that the conversations that are had focusing on how equitable math learning opportunities can be provided to all learners is powerful and engaging.  The turn around time between meetings is too short and is a challenge to get everything done with meeting with the teacher to plan a lesson, observe the lesson and then reflect on the lesson.','2 weeks until our next coaching session is too 