day.','I appreciate everything that you a doing to help us do our job effectively with teachers.',13,7,0,0,0,'Time to read through the IPG and then discuss our Low-Inference Notes from watching the video (how to score the IPG)'),(10270,1603339200,'Delaware Department of Education, DE','School-based coach',3,5,3,4,5,3,'','Using the IPG with teachers',4,4,4,0,0,'Sharing out about our experiences with teachers after our last meeting. Learning about and starting to internalize the IPG','I feel as though when we got to some break out rooms to discuss after asynch time, some people had been confused by the directions and therefore misunderstood their responsibility for the task so the conversation took a turn. ',8,'I feel like today\'s session for me felt a little rushed. I wish we had more time to digest the IPG. ','',13,7,0,0,0,'IPG analysis'),(10271,1603339200,'Delaware Department of Education, DE','District/network-based coach or Curriculum and instruction specialist',3,4,3,3,3,2,'','IPG Tool',4,4,3,0,0,'balance of independent work, whole group and small group breakout rooms.','too many documents needed, I often felt lost in the mix even with two screens, and 3 windows open on my desktops.',6,'Some parts still feel disconnected for me and I\'m not sure others work with would see the value right now without feeling overwhelmed.','Content is a bit dry',13,7,0,0,0,'small group breakout, specifically the sharing of the IGP Analysis- it helped me deepen my understanding of the IPG and internalize the document more.'),(10272,1603339200,'Delaware Department of Education, DE','Teacher or specialist',5,5,5,5,5,5,'','Using the Instructional Practice Guide while looking over developed lessons.',5,5,5,0,0,'I enjoyed the Asynchronous time to think and workout rough draft thoughts.','Maybe more time on each item or less content in one day.',10,'Very thorough and relevant to my profession.','N/A',13,7,0,0,0,'Practicing with the IPG and wrapping my head around Low inference note taking'),(10273,1603339200,'Delaware Department of Education, DE','District/network-based coach or Curriculum and instruction specialist',5,5,5,5,5,1,'','IPG ',5,5,5,0,0,'The sense of community and the asynchronous working time to really dig and reflect on our own learning. Provides processing time ','',10,'','',13,7,0,0,0,''),(10274,1603339200,'Delaware Department of Education, DE','District/network-based coach or Curriculum and instruction specialist',5,5,5,5,5,4,'','Narrowing down a Core Action focus for my work with my teacher.',4,5,5,0,0,'The break out sessions were very productive-great collaboration.','',10,'Our facilitators are knowledgeable and have a passion for this work. I\'ve learned a lot.','',11,8,0,0,0,''),(10275,1603339200,'Delaware Department of Education, DE','Teacher or specialist',5,5,5,5,5,5,'','Using the IPG as planning tool as well as for observation',5,5,5,0,0,'The timing was very good and explanations/clarifications helpful.','More discussion on eval of the lesson and use of IPG-specific answers/recommended responses.',10,'It\'s very informative, relevant and forward-looking and is working on improving ELA instruction...dire need!','',11,8,0,0,0,'The video lesson and completed IPG.'),(10276,1603339200,'Delaware Department of Education, DE','District/network-based coach or Curriculum and instruction specialist',5,5,5,5,5,3,'','The IPG tool!  ',5,5,5,0,0,'The breakout groups were very helpful.  The size was perfect.','I wish that we could have talked a bit more about how this would look in an online classroom.  ',10,'With these practices in place, I feel that teachers will become stronger educators and will be able to meet the rigor and expectations of the CCSS. The planning tools take a lot of the guess work out of planning.  ','Thank you for this excellent opportunity.',11,8,0,0,0,'The opportunity to interact with the materials asynchronously and then returning to discuss in a small group.'),(10277,1603339200,'Delaware Department of Education, 