'Teacher or specialist',3,3,3,3,3,3,'','',3,4,3,0,0,'','Due to Covid and bad weather, we actually had each session during school days that should have been used as planning time to grade or assist students. As it was, I had to step out of the Zoom meeting multiple times to help students who were having trouble with assignments virtually, or answer a phone call with a parent, etc. Needless to say, I was quite distracted today, and I would say that, given the circumstances, the timing could have been better still.\n\nThe lack of technology was also an obstacle, as cameras and mic could not be provided to us until this afternoon. Again, it\'s completely understandable, as they were on backorder due to Covid, but this made it all but impossible to actually participate and be engaged in the sessions.',5,'','',22,1,0,0,0,''),(10457,1600833600,'Tangipahoa Parish, LA','Teacher or specialist',5,5,2,4,4,2,'It has definitely helped me become more familiar with the resources in the curriculum hub. I am at a k-8th school that has an advanced 8th grade placement for English I so I already have students in the classroom already.','Chunking the complex texts using appropriate scaffolding and building background knowledge.',4,5,5,0,0,'The breakout sessions and whole class discussions','',8,'It is helpful but in the future I think this professional development would be better during the summer or at least before the start of the school year. ','',22,1,0,0,0,'Activities as a whole class where we read then discussed '),(10458,1600833600,'Tangipahoa Parish, LA','District/network-based coach or Curriculum and instruction specialist',5,5,5,5,5,2,'','Using the LDOE Hub to plan instruction',5,5,5,0,0,'Explaining the pattern of construction of the Guidebook 3.0','n/a',10,'It was an effective training for understanding Guidebook 3.0','I enjoyed the energy of the instructor, Mrs. Holli.',22,26,0,0,0,'Activities highlighting planning and annotating'),(10459,1600833600,'Tangipahoa Parish, LA','T