d where we are right now, but any time any of us expressed what we actually need support with she seemed unwilling to change course.','I am looking forward to exploring the EL curriculum so that I am prepared to implement it.',3,2,2,2,2,'We were given a couple of opportunities to interact with the EL curricular resources.','If the course was actually about the EL curriculum. It was more focused on professional learning. This would be great any other time, but during a pandemic we need SUPPORT with the curriculum.',0,'I did not feel that it met my needs at this moment','',8,1,21,0,0,'Being able to see the resources we will be using.'),(10505,1599105600,'NYC District 11 - PS 189, NY','School-based coach',3,4,4,3,4,3,'','Use of the supports for students',5,4,4,4,4,'The opportunities to navigate the modules and lessons and assessments.','Getting into the curriculum itself sooner in the course.',5,'Some colleagues felt they would have liked more specific direction on the curriculum itself.','',8,1,21,0,0,'Reflecting on the assessments and what is necessary for students to know to achieve success.'),(10506,1599105600,'NYC District 11 - PS 189, NY','Teacher or specialist',5,5,5,5,5,4,'Breakout sessions on remote learning','Choosing high interest topics for students',5,5,5,0,0,'Looking at the overview of the modules and then each component specifically','More resources for online component',10,'Great bootcamp for getting to know the program','',8,1,0,0,0,'Looking at the differentiated activities to support all learners'),(10507,1599105600,'NYC District 11 - PS 189, NY','Teacher or specialist',4,4,5,5,5,3,'The resources were great tools to help start the school year','',5,5,5,5,5,'','More info on how to teach EL in a remote setting',9,'This is a great training for anyone unfamiliar with EL or with teaching lab practices. For those who are already experienced in these, this learning is redundant. ','',8,1,21,0,0,''),(10508,1599105600,'NYC District 11 - PS 189, NY','Teacher or