ns about how to make this curriculum work in a distanced classroom.',8,'It was too much information. I understand it was a Bootcamp, but it was hard.','',8,6,27,0,0,'Listening to my colleagues during discussions.'),(10569,1597809600,'NYC District 11 - District-wide, NY','Teacher or specialist',5,5,5,4,4,3,'Observing the different ways we responded to assignments and tasks such as breakout rooms, discussion prompts, assignment submissions...','Using the new curriculum, complex texts, and the performance tasks at the end of a module.',5,4,4,4,4,'Learning new knowledge about the shifts in the curriculum; the modules and how each unit builds on another up to the performance task.','It took me a while to maneuver through the online information to do assignments. I think more time to go over lessons with the facilitators and then small groups by grade to get a better idea of the flow, etc.',10,'This Bootcamp was very informative and a scaffolded training prior to using the new curriculum.','There was a lot of pertinent information in a short amount of time to help me get acclimated to the curriculum.',8,6,27,0,0,'Breakout groups, docs that I could print and look at, videos'),(10570,1597809600,'NYC District 11 - PS 89, NY','Teacher or specialist',5,5,5,5,5,5,'I feel confident to embark on the journey of the unknown so to speak because I am excited about the curriculum I am going to teach. I feel more prepared then in my previous years and know the direction I want to take for my students to engage.','I am excited to hear my students present the performance task and celebrate with them all of their hard work.',5,5,5,5,5,'I think the discussions was successful.','Nothing, it was great!',10,'I thought it was a great experience.','I would like to continue this work.',8,6,27,0,0,'I believe the combination of the zoom calls (with the breakout rooms especially) and independent Moodle assignments made it easy to complete the work.'),(10571,1597809600,'NYC District 11 - PS 89, NY','Teacher or specialist',5,5,5,5,5,5,'We discussed how we could implement the curriculum remotely.  Examples include using technology and Google Docs for collaboration.','I am excited to implement the updated version of A Long Walk to Water.  My students have loved the first unit for years with my added flare and now some of my ideas have been embedded in the new edition.  So ironic and flattering at the same time. ',5,5,5,5,5,'The breakout rooms with my colleagues.','Maneuvering through some of the activities on the Moodle Platform were confusing. ',10,'The facilitators were knowledgeable on the content and very friendly. ','Thank you to Ryan and Justin!  The bootcamp was worth it.',8,6,27,0,0,'The independent readings were enlightening. '),(10572,1597809600,'NYC District 11 - PS 89, NY','Teacher or specialist',5,5,5,5,5,5,'By learning more protocols and conversation cues that will encourage routines and equity in the classroom.','Making real world connections.',5,5,5,5,5,'The readings, the conversations both in the large group and the breakout rooms and the work.','Nothing',10,'This was well organized PD that is useful for our classrooms.','',8,27,6,0,0,'The Module Unpacking Protocol'),(10573,1597809600,'NYC District 11 - PS 89, NY','Teacher or specialist',4,4,4,4,4,3,'','I am excited to give the students choice.',5,5,5,5,5,'Understanding the El curriculum','Showing what it will look like virtually.',8,'It was very thorough snd informative. ','',8,6,27,0,0,'all of the activities were helpful'),(10574,1597809600,'NYC District 11 - PS 89, NY','Teacher or specialist',5,4,5,5,5,4,'','4 T\'s and RTTW',5,5,5,5,5,'The outline and course assignments gave me time to complete them on time.','Having the physical curriculum to look at but under the circumstances, I understand. Also, there was nobody on my grade that I could speak with about the modules I will be teaching.',10,'The facilitator were knowledgeable and helpful','',8,6,27,0,0,'The videos and PDF\'s were helpful'),(10575,1597809600,'NYC District 11 - PS 89, NY','Teacher or specialist',5,5,5,5,5,5,'I feel more confident in getting started with EL 2.0','Language Dives',5,5,5,5,5,'The scheduling of work ws fair and attainable','Partnerships with a grade band person or team to delve into a grade specific unit',10,'','',8,6,27,0,0,'The reflections after each session and the activities that were specifically tailored'),(10576,1597809600,'NYC District 11 - District-wide, NY','School-based coach',5,5,4,5,5,4,'Through collaborative talks with colleagues during the sessions ','RTTW',5,5,5,5,5,'','',9,'','',8,28,6,0,0,''),(10577,1597809600,'NYC District 11 - District-wide, NY','School-based administrator or supervisor',5,5,5,4,4,5,'','RTTW ',5,5,5,5,5,'I think the way the moodle was structured in an RTTW model was helpful to see how this can be applied in a remote environment.  I liked the accountability of submitting items for feedback.  This course helped me successfully and sustainably unpack three grade levels of curriculum.','More exemplars',10,'','',8,6,27,0,0,'Unboxing protocol'),(10578,1597809600,'NYC District 11 - District-wide, NY','Teacher or specialist',4,5,4,5,5,4,'','Creating a sense of community in my class through the protocols and equity initiatives.',5,5,5,5,5,'','',7,'The content of the PD was good, I had a little difficulty with the platform, locating resources and my laptop did not cooperate at times.','I enjoyed meeting and working with both Ryan and Justin and I enjoyed working with my colleagues in the break out rooms.',8,27,6,0,0,''),(10579,1597809600,'NYC District 11 - IS 355, NY','School-based coach',5,5,5,5,5,4,'Initially I had a hard time believing that our students are able to engage in small group discussions or be members of collaborative teams. But the activities that we engaged in via zoom and break out rooms illustrated that this is possible. Though we are adults and able to manage ourselves more than an average middle school child, the platforms are there to keep our students engaged, thinking, and sharing their theories about the texts they read. Protocols and structures are important in Covid teaching times and these were also greatly modeled for us throughout our time together. It\'s possible!','The importance of providing students time to read, think, talk, and write. We must provide the time and space for this, get out of the way, and talk less. I love the idea that the text is the expert in the room, rather than the teacher. \"What does the text say?\" ',5,5,5,5,5,'The activities that repeatedly brought us back to do our own close reading of the texts. The questions we were asked were thoughtful and rigorous. The workshop in general utilized the same protocols and supports that we are expected to use in the EL curriculum with our students. I made many connections between the work that we did and the work our students will do. ','I think the only thing that I would try to improve is to have a folder where all the materials are rather than having to download everything then upload it back to the assignments. There is a lot of valuable, meaningful information here that I\'d like to share with the teachers but having to download the videos and documents one by one will be time consuming for me. I want it all! ',10,'Because this was extremely informative and like I said earlier, I think that this course modeled exactly how our students should be building their own knowledge about a topic. We engaged in Text,Task,Targets,Topics using the RTTW process as well as using the protocols and supports. They did a great job of embedding the practices of EL in this course which helped me make the connections I needed to know that it is possible for our students to be challenged and engage in rigorous learning activities even in these unprecedented times. Bravo!','Justin and Ryan were patient, accommodating, knowledgeable, and made this course accessible.  They were well prepared each time and never let us get off course. ',8,6,27,0,0,'Application activities where, after we read, we were asked to apply that learning to some kind of reflection or summary activity. The activity in session 12 was especially rigorous and supported my learning as I was able to connect how the protocols and supports reflect RTTW. It reminded me that these are all connected and are not isolated. '),(10580,1597809600,'NYC District 11 - PS 89, NY','Teacher or specialist',5,5,5,5,5,5,'','Using scaffolds and supports already given to me to try to use with my students.',5,5,5,5,5,'I liked the layout of the course- everything was very clear (especially on a new learning platform), if you had any questions-the facilitators answered right away, and they allowed us time to collaborate with our grade bands throughout zoom meetings.','Nothing ',10,'For my first virtual PD, this PD was very informative and relevant to implement into my classroom at the start of the school year.','Thank you to the facilitators!',8,6,27,0,0,'I liked watching the videos of teachers putting the protocols into action. I also really liked the unboxing method for backwards design. Considering the 4T\'s in a lesson is very significant.'),(10581,1597809600,'NYC District 11 - District-wide, NY','Teacher or specialist',4,4,3,3,3,3,'Although this course was very helpful, we would need much more information and time to learn how to make this work with the new guidelines and norm.  This was in no way the fault of the presenters- they were great! ','RTTW, Free Recall',4,5,5,5,5,'The videos and zoom calls for clarification.','Having all of the documents for printing located in one place on the left sidebar- some of the assignemnts were difficult to complete because of this.\nThe submission of docs on Moodle was sometimes tempermental!',7,'I felt that this was a great jump start to EL but there is STILL SO MUCH MORE TO LEARN!  It would\'ve been more beneficial to have some kind of teacher\'s guide handy or a resource manual to refer to other than having to rely on printing SO many things.','Justin and Ryan did an amazing job making everyone feel comfortable to talk and share.  They were very accomodating and provided adequate feedback on assignments.',8,6,27,0,0,'videos, examples of the curriculum'),(10582,1597809600,'NYC District 11 - District-wide, NY','Teacher or specialist',4,5,4,4,5,4,'This course gave me background knowledge. So once school begins, I won\'t feel or look like a deer in highlights; that I have some familiarity with the program.','I most excited about utilizing all the resources available in the program--protocols, conversations cues, etc.',5,5,5,5,5,'','',7,'The PD was interesting. The platform was a little difficult for me to navigate.  Also my laptop did not cooperate at times.','Both my facilitators were available to me for any off-line questions and both of them got back to me right away.',8,6,28,0,0,''),(10583,1597809600,'NYC District 11 - PS 87, NY','Teacher or specialist',5,5,5,5,5,4,'','Engaging my students through play and conversation, working on speaking and listening skills',4,5,5,5,5,'It was interactive which kept us engaged.','It was as good as it could be in a virtual setting!',8,'','',8,6,27,0,0,'Breakout groups, filling in organizers'),(10584,1597809600,'NYC District 11 - PS 87, NY','School-based administrator or supervisor',5,5,5,5,5,5,'This is a new curriculum for us and this course was a good beginning to get me to understand the various components of EL, digging into the modules, thinking about a vision of what I want to see in  classrooms and be able to support teachers.','It was all important but must important to make sure the classroom is collaborative and students are engaged in complex text and take more ownership of their learning.',5,5,5,5,5,'Really enjoyed the break out discussion sessions','',10,'This was a great beginning to get anyone new to the curriculum to have the basics needed to get deep into the learning','Thank You Great Bootcamp',8,6,27,0,0,'Learning from each other during discussion'),(10585,1597809600,'NYC District 11 - District-wide, NY','Teacher or specialist',5,5,5,5,5,5,'This course helped me become familiar with the materials and protocols to move forward for September.','The discussion protocols',5,5,5,5,5,'Exploring materials, having group discussions in breakout rooms and having a chance to create a vision and work at our own pace.','Seeing a lesson in action',10,'It was an engaging training that made me feel comfortable with the work ahead.','no',8,6,27,0,0,'Looking at engaging tects, various questions, etc.'),(10586,1597809600,'NYC District 11 - PS 87, NY','School-based administrator or supervisor',4,5,4,4,4,4,'THE EL CURRICULUM IS NEW TO MY SCHOOL. BY WALKING US THRU SOME OF THE ACTIVITIES GIVES ME AN IDEA OF HOW TEACHERS AND I CAN/SHOULD LOOK AT INSTRUCTION','VIEWING THE LESSONS TO SEE HOW CLOSELY THEY HELP TO DESIGN THE PERFORMANCE TASK',5,5,5,0,0,'WE HAD AN OPPORTUNITY TO TRY OUT AND DISCUSS DURING BREAKOUT ROOMS','SOME MORE DEEP DIVE INTO LESSONS',9,'I NEED MORE EXAMPLES OF PLANNING, I WANTED MORE HAND HOLDING OF A LOOKING AT HOMEWORK AND DISCUSSION THE READING MATERIAL, ESPECIALLY THE FIRST SESSION\'S READING ASSIGNMENT,  I DID NOT MAKE A CONNECTION TO EL UNTIL SESSION 2, I COULD NOT KEEP UP WITH HOMEWORK DUE TO OTHER RESPONSIBIITIES','NO',8,6,0,0,0,'IDEAS FROM OTHER PARTICIPANTS'),(10587,1597809600,'NYC District 11 - PS 87, NY','Teacher or specialist',5,5,5,5,5,4,'I know and have the resources I need to help prepare me for school opening!','RTTW',5,5,5,5,5,'Break out rooms, the questions asked during the zoom meeting and the videos!','More videos of teaching of EL',9,'Facilitators very knowledgeable and caring','thank you',8,6,27,0,0,'Videos and chats'),(10588,1597809600,'NYC District 11 - PS 89, NY','School-based administrator or supervisor',4,3,4,3,5,4,'','',4,4,4,4,5,'User accessibility for course learning activities','More opportunities to engage with the EL curriculum for all participants',8,'I would have liked more opportunity to unpack the curriculum','',8,6,27,0,0,''),(10589,1597809600,'NYC District 11 - PS 87, NY','School-based coach',4,4,4,4,5,2,'As we unpacked the modules we were given time to think about how this would look through remote instruction, then we discussed it in small groups.  ','The templates used to unpack the modules were helpful for my work in facilitating PD in my school building.',5,5,5,5,5,'I liked the use of the breakout rooms in the beginning that were randomized.  It forced all participants to use their video and speak up.','Time to unpack more...I also would have liked more time in walking through the EL materials during a Zoom call.',8,'It would be a great PD for all teachers in my building.  The room for growth would be for more time in looking through the materials.','',8,6,27,0,0,'The templates used to unpack the modules.  '),(10590,1597809600,'NYC District 11 - PS 89, NY','Teacher or specialist',4,5,5,5,5,1,'','Class anchor charts',5,5,5,4,5,'Sense of community','Model a lesson for us please',8,'Facilitators are so nice!','Thank you!!!',8,6,27,0,0,'Breakout Rooms'),(10591,1597809600,'NYC District 11 - PS 89, NY','Teacher or specialist',5,5,5,4,5,4,'Having many Kindergarten students, in which this will be their first school experience will be challenging. Once they master the laptops/tablets I feel I can engage them in learning.','I am most excited to support my students with language dives in academic sentences to help build in comprehension of text and help them develop a word bank that would enhance their conversations.',5,5,5,5,5,'The pacing of this course was excellent. During the summer, when teachers are not instructing and planning while learning the curriculum at the same time is an ideal time to actually internalize all the information.','I was not able to register myself, so the Assistant Principal registered me. Unfortunately, the information given was incorrect and by the time I was able to go on the Teaching Lab many of my assignments were late. I know there was no  penalty and this was just a personal issue for me, lol  Other than that I really enjoyed learning all that the EL Curriculum has to offer the teachers and students. Thank You!',10,'I believe there is always room for improvement. Even if you have taught the EL curriculum years before, there so much to reflect on that pertains to what our students are facing in todays world.','Not at this time.',8,6,27,0,0,'Justin and Ryan did an amazing job in grouping the teachers to reinforce what we read and towards the end in our grade bands to unpack the Module/Units.'),(10592,1597809600,'NYC District 11 - District-wide, NY','School-based administrator or supervisor',5,3,5,3,4,3,'Techniques to use when unpacking Grade Level Content Materials','Unpacking the materials - TG/Supports; closely looking at Modules 1, Unit, Lesson 1 to get the gist',5,5,5,3,4,'Asynchronous work; Break out group sessions - learning from each other','Having 2 or 3 sessions for admin separately with the three weeks',9,'You own your learning; Course is well structured for remote climate','As an admin, I find that the requirements were overwhelming but extremely useful. Because of the climate, it was a bit challenging as I\'m also supporting my principal with the re-opening process. All in all, assignments scheduled were quite appropriate to fully understand the curriculum. ',8,6,27,0,0,'Unit Boxing; Elevator Pitch'),(10593,1597809600,'NYC District 11 - PS 89, NY','Teacher or specialist',5,5,5,5,5,5,'I\'ve learned about the way each module is set up and how they each build on one another','Applying the 4TSs during my instruction',5,5,5,5,5,'I enjoyed the discussing and break out rooms','n/a',10,'the facilitators made this pd very engaging','n/a',8,6,27,0,0,'breakout rooms '),(10594,1597809600,'NYC District 11 - District-wide, NY','School-based coach',5,5,5,5,4,5,'It helped me prioritize how to plan and internalize lessons with appropriate sca