ing about Covid - it\'s about the curriculum','',5,5,5,0,0,'','',6,'','',23,12,0,0,0,'Discussion'),(11014,1595476800,'Lafayette Parish, LA','Teacher or specialist',5,5,5,5,5,4,'Helped me be more familiar with using the guidebooks and some strategies to use virtually','the close reading activities ',5,5,5,5,5,'collaboration','knowing more about the actual curriculum we will be teaching in a few weeks',9,'well organized, very detailed and informative, Erin and Liza were great facilitators','no',23,11,18,0,0,'the breakout sessions'),(11015,1595476800,'Lafayette Parish, LA','Teacher or specialist',5,5,5,5,5,3,'Ready to dig in','The method to the maddness',5,5,5,0,0,'Everything went well','nothing... maybe starting at 10 (more sleep time lol)',10,'Errin was excellent','none',23,11,0,0,0,'connections to what I know about guidebooks helped'),(11016,1595476800,'Lafayette Parish, LA','Teacher or specialist',4,4,4,4,5,3,'Gave me some reassurance that I would be able to do it and I am not in this alone. ','Definitely the different strategies to improve fluency. ',5,5,5,0,0,'The lessons went well. ','Would like more guidance on how to actually navigate guidebooks. ',7,'Just because I would\'ve liked more information on how to access things in guidebooks etc. ','No.',23,11,0,0,0,'The activity that we did with the Robert Frost poem. '),(11017,1595476800,'Lafayette Parish, LA','Teacher or specialist',4,5,4,5,5,3,'','',5,5,5,5,5,'Well','',8,'','',23,11,18,0,0,''),(11018,1595995200,'DeSoto Parish, LA','Teacher or specialist',4,4,4,4,4,3,'Resources for virtual teaching and assessing have been made available.','I am most excited about using the microphases to target students\' needs.',5,5,5,5,5,'The presenters were very organized and were so easy to follow and understand.','I would have liked to have more planning time involved in the training.',10,'I found the presenters to be knowledgeable  and did a fantastic job helping us to understand the Skills block. ','No',15,30,10,0,0,'The articles and videos we watched through the session assignments were beneficial.'),(11019,1595995200,'DeSoto Parish, LA','Teacher or specialist',5,5,5,5,5,5,'','skills blocks',5,5,5,5,5,'','',10,'','',15,30,10,0,0,''),(11020,1595995200,'DeSoto Parish, LA','Teacher or specialist',4,4,4,4,5,4,'I feel more confident with our new curriculum.','I am very excited about the skills block as a whole. I love the Jeffi stories and how we will introduce letters. I really think my kiddos will LOVE it!',5,5,5,5,5,'The expectations were clearly outlined and communicated.','I am a visual learner so more videos and seeing it in action would have been good for me. ',8,'I really think that this learning platform was beneficial for diving into what we would be teaching. Like I mentioned, more videos of seeing it in action would´ve been helpful!','',15,10,30,0,0,'The parts where we actually dove into the curriculum and looked for the resources we would need.'),(11021,1595217600,'Washington Parish, LA','Teacher or specialist',5,5,5,5,5,5,'Unfortunately, one of the primary concerns for school opening after COVID-19 are all the \'unknowns\' on top of the epidemic itself. However, this course was taught in a way that actually helped ease the unnecessary anxieties with school beginning and helped find solutions to potential struggles produced by the virus; such as internet restrictions, one to one meetings. Lauren made many great suggestions and asked us what we thought may be suitable solutions. She helped us remember to be thinking forward when it comes to these relational meetings. It may not be as easy to conduct a meeting over coffee but doing one virtually. Furthermore, we were allowed to collaborate with our peers, which as we all should know by now, is fundamental to creating an effective professional learning community.','Bringing this information to other teachers and asking what pieces resonate with them. Asking teachers what they think we could focus on and how they feel best to introduce new or improved policies.',5,5,5,0,0,'I felt as though this course really brought everything, no pun intended, full circle from previous modules. By the end of the module I felt as if I could conceptualize everything from before, up to the end of the course.','Nothing',10,'I already have suggested this to many other teachers in other parishes. Two of my friends have already begun an open dialogue in two different schools located in New Orleans lower 9th ward school system!','None',6,29,0,10,0,'Having the time to discuss articles, being able to hear others ideas, being prompted to really reflect on the data/materials without any leading questions. The open-ended questions require you to remain engaged and also challenges your pre conceived thoughts by digging deep into the content. This also helps build confidence.'),(11022,1594872000,'Washington Parish, LA','Teacher or specialist',5,5,5,5,5,3,'By digging into the lessons, we were able to analyze which parts were suited for synchronous learning and which were better suited for asynchronous learning.','???',5,5,5,0,0,'Breakout sessions with grade level.','More time',10,'It was very informative and professionally delivered.','',6,29,0,0,0,'Digging into the lessons to see how they are designed to lead to the unit goal.'),(11023,1594958400,'Louisiana State Content Leader Training, LA','Teacher or specialist',5,5,5,5,5,5,'More exposure to Zoom meetings and setting up lessons from an online source','Using optional lessons for my diverse learners',5,5,5,5,5,'Explanation of material','Nothing.',10,'The overall feel and effective instruction of our facilitators to make sure we understand the material.','Just that it was extremely thorough covering as much material as possible in the time frame we had. The facilitators were passionate about the material and made us equally engaged to know more.',22,26,27,2,0,'Practical experience working with the guidebooks from a teacher\'s and from the student\'s side of learning.'),(11024,1594958400,'Louisiana State Content Leader Training, LA','District/network-based coach or Curriculum and instruction specialist',5,5,5,5,5,4,'I became more familiar with Guidebooks 9-12 and with ZOOM as well.  This will help if we have to go to virtual classes. ','The new content and the supports for teachers and students as I share with teachers.',5,5,5,5,5,'The new design and content of Guidebooks 9-12 was presented effectively.','Everything was good.  I would not change anything.',10,'I feel that the training was very timely and helpful, the facilitators were great, and the communication among the participants was informative.','I wish all teachers of Guidebooks 9-12 could participate.',22,2,4,3,0,'Delving into the units and exploring the teacher and student tools was helpful.'),(11025,1594958400,'Louisiana State Content Leader Training, LA','Teacher or specialist',5,5,5,5,5,5,'How to unpack the curriculum and plan for instruction regardless of virtual or brick and mortar presentation.','Collaboration on units; identifying skills & knowledge students need to be successful and how they\'re relative to the culminating task.',5,5,5,5,5,'Everything! This was very helpful and informative.',' I would like to have copies of slides presented and videos to reference.',10,'This is the type of classroom I strive to have. It had independent and group work, volunteers for questions, and prepared and knowledgeable instructors.','When is the next one??',22,26,27,2,0,'Exemplars, breakout sessions, group discussions'),(11026,1594958400,'Louisiana State Content Leader Training, LA','District/network-based coach or Curriculum and instruction specialist',5,5,5,5,4,5,'Teachers will be able to determine what courses can be virtual and which can be face to face.  With the optional activities, it will be easier to help struggling students using the platform as well. ','Using the platform and having access to such great texts.',5,5,5,5,5,'The learning experience overall was positive and very informative.','Having a hard copy of the notecatcher.',10,'As a content leader, I know how the guidebooks work but with this training, I really learned so much more about the tools that will benefit both students and teachers in the classroom.  I love the optional activities that are now available and how easy it is to see how the texts/materials are connected to help build knowledge and understanding.','',22,26,27,2,0,'Breaking down the lesson, activities, and unit study tool.'),(11027,1594958400,'Louisiana State Content Leader Training, LA','Teacher or specialist',5,5,5,5,5,3,'When we talked about annotating lessons, we mentioned how to address certain activities virtually.','Releasing control of my lesson planning and putting that effort into annotating the lessons that are provided.',5,5,5,5,5,'Pacing; We moved through the information at a faster pace because we did not have to wait for conversations to die down','Having time embedded to do some of the unit study tool work with my own grade level units',10,'Before my Teaching Lab professional development sessions, I was very resistant to guidebooks. I wanted to utilize my Curriculum and Instruction degree and remain autonomous. This was unfair to my students especially considering the amount of wasted time we see reported in \"The Opportunity Myth\". Now that the curriculum has included more diverse works, I can see myself teaching the units with more fidelity.','',22,26,27,2,0,'Action Planning'),(11028,1594958400,'Louisiana State Content Leader Training, LA','District/network/state-level professional or administrator',5,5,5,5,5,3,'','I\'m excited to coach teachers on understanding 3.0',5,5,5,5,5,'The material was clear','',9,'It wasn\'t a 10 simply because of the length of the training. Most don\'t have 3 days to allot to a training plus homework time. I also understand that 3 days isn\'t truly enough to do the curriculum justice. Maybe an option to spread out 1 day a week over 3 weeks? I also see the downside of that as well. It\'s just hard to make it work for everyone.','',22,26,27,2,0,'The experiential pieces were helpful to understand the purpose of components.'),(11029,1594958400,'Louisiana State Content Leader Training, LA','Teacher or specialist',5,5,4,5,4,3,'It did not help with that.','Working with Hamilton',3,4,4,0,0,'Breakout Discussions','The breaks were too long; shorter breaks would have been better.',7,'','No',22,26,0,10,0,'Breakout Discussions'),(11030,1594958400,'Louisiana State Content Leader Training, LA','District/network-based coach or Curriculum and instruction specialist',5,5,5,5,5,5,'The course helped give me ideas on how to plan for virtual learning ','Unit and lesson plan protocols ',5,5,5,5,5,'The asynchronous/synchronous components were really well structured. It felt engaging and not overwhelming in the online environment ','N/A',10,'Teaching Lab always does a phenomenal job with training. They did well with the virtual implementation. This was as effective as the in person content leader trainings ','',22,26,27,2,0,'Working with peers, seeing examples, open discussions '),(11031,1594958400,'Louisiana State Content Leader Training, LA','Teacher or specialist',5,5,5,5,5,5,'','The core activities ',5,5,5,0,0,'Everything ','',10,'Everything went well (the timing, the breaks, the activities)','',22,26,0,10,0,'The combination of breakout rooms and whole group instruction'),(11032,1594958400,'Louisiana State Content Leader Training, LA','Teacher or specialist',4,5,2,3,5,4,'I know how I want to decorate my room to improve learning.','unit study',4,5,5,5,5,'interactions','finding resources',8,'Because we\'ve already gone through this training before','where are the materials',22,26,27,2,0,'templates'),(11033,1594958400,'Louisiana State Content Leader Training, LA','Teacher or specialist',5,5,5,5,5,2,'','Diving in and getting started!',5,5,5,5,5,'','',10,'','',22,26,27,2,0,''),(11034,1594958400,'Louisiana State Content Leader Training, LA'