ell.','',8,'','',22,26,27,2,0,'Interacting with Louisiana Curriculum Hub. '),(11058,1594958400,'Louisiana State Content Leader Training, LA','Teacher or specialist',4,4,3,5,4,4,'I know how to implement the Guidebooks lessons better with my own students and to help other teachers understand it.','The new Hub information for my own Guidebook section.',4,4,4,4,4,'The presenters were well knowledgeable, and everything was well timed.','The note catchers were confusing sometimes, because the pages weren\'t always mentioned, or the content wasn\'t always in the same area as we were reviewing.',8,'It was great, and just a few improvements with the note catchers will make it perfect.','N/A',22,26,27,2,0,'Actually doing examples with the books and activities from the 10th grade unit.'),(11059,1594872000,'Washington Parish, LA','Teacher or specialist',5,5,5,5,5,4,'Sync vs async ','Preparing students for CWT. ',5,5,5,0,0,'Break outs','Nothing ',8,'Highly effective presenter ','No',6,29,0,0,0,'Break outs '),(11060,1594872000,'Washington Parish, LA','Teacher or specialist',5,5,5,5,5,5,'','The backwards planning design',5,5,5,0,0,'Everything went well','Being in person, but everything was still great',10,'I chose that rating because there was some really helpful tips given.','',6,29,0,10,0,'The breakout groups'),(11061,1594872000,'Washington Parish, LA','Teacher or specialist',5,5,5,5,5,5,'Yes','A Zoom',5,5,5,5,5,'Unpacking unit','More time with breakout groups ',10,'It was helpful ','None ',6,29,32,7,0,'Breakout sessions '),(11062,1594872000,'Washington Parish, LA','Teacher or specialist',4,4,4,4,4,3,'I learned how to use the various tools in ZOOM. Although, I had some technical issues, I was encouraged to work thru them and better my efficiency. ','I\'m more excited about the virtual aspect of delivering lessons. ',4,4,4,0,0,'Collaboration with fellow grade-level teachers went well for me. ','I\'m getting more familiar with the technology tools will be an improvement. ',8,'As a