ues across the district, and we will be able to plan together in the fall.','I\'m most excited to teach in person using the supports embedded in the curriculum. There are so many great resources!',4,5,5,5,5,'I thought the flow of activities (mindset to application) was well designed.','I would have loved to see some model lessons of EL done virtually.',10,'I really enjoyed my facilitators, Kristen and Tara!','',8,20,3,0,0,'I really enjoyed working with my grade level group. I liked discussing our unpacking and our visions together.'),(11129,1593662400,'West Contra Costa USD, CA','Teacher or specialist',5,5,5,5,5,3,'Some of the techniques in the Zoom meetings helped me see how to host a Zoom class meetings could run more smoothly.','I\'m job-sharing in a kindergarten next year. Last year, I worked with 2nd grade. Loved the high-interest modules, all the protocols and skills block. This bootcamp gave me a chance to dig into the 1st module of kindergarten. Very useful and helpful!',4,5,5,0,0,'Enjoyed the combination of direct instruction, breakout rooms with colleagues and the asynchronous work.','Possibly more days taking an even deeper dive.',9,'It was well-organized. Presenter was excellent and very easy to understand. Co-host was efficient, making the meeting run smoothly. Good content.','Looking forward to the development of more digital support for teachers.',8,9,0,0,0,'breakout conversations and asynchronous work'),(11130,1593662400,'West Contra Costa USD, CA','Teacher or specialist',5,5,5,5,5,4,'We discussed ways to implement Anchor charts through Google docs and group discussions through Zoom breakout rooms.','Generating enthusiasm for the topic.',5,5,5,0,0,'We were given a great overview on how to approach the curriculum which included the why as well. We were given strategies to implement the units online if need be.','It would have been nice to meet in person but that wasn\'t really doable.',10,'The facilitator was very helpful, personable, clear, and welcoming.','Facilitator made me feel welcome and was very engaging.',8,6,0,0,0,'Break out groups where we discussed specific parts of the EL curriculum.'),(11131,1593662400,'West Contra Costa USD, CA','Teacher or specialist',4,4,5,5,4,4,'Heard about zillion','vision goal',5,5,5,5,5,'Lots of information','unsure',8,'I think it\'s good if you\'re starting EL and never used it before','',8,9,6,0,0,'Live calls'),(11132,1593662400,'West Contra Costa USD, CA','Teacher or specialist',2,3,3,3,4,4,'It reminded me that my teaching was a good career choice.','Giving all students a voice in the class no matter their reading level.',1,5,5,5,5,'Mandi had a a clear aspect of the curriculum and I am sure it wasn\'t easy to facilitate in this this way. Kudos to her.','It would have been great if I had breakout room with my team since we were on Mod. 4 I would have liked to explore Mod 4 sine we didn\'t get to it this year.',7,'Because I thought that the homework were asked to do seemed like a bit of \"busy work\' to be honest. I would have liked to dig into Mod 4 as I stated above.','n/a',8,9,6,0,0,'What out goals are :looks, sounds and feels like'),(11133,1593662400,'West Contra Costa USD, CA','Teacher or specialist',5,5,5,5,4,4,'They recommended another course.','4Ts',4,5,5,0,0,'Great time management, smooth transitions, and clear expectations.','I may have liked having the same group more often in order to form more community.',10,'I enjoyed it and i believe it was helpful.','',8,9,0,0,0,'Breakout rooms'),(11134,1593662400,'West Contra Costa USD, CA','Teacher or specialist',5,5,5,5,5,4,'The use of Universal Design in teaching and learning, the equal opportunity for the students and how I may be able to collaborate with the general education teachers to support our students with special needs.','Access to the new curriculum, learning its structure and the support I can provide to both teachers and our students.',5,5,5,5,5,'The zoom meeting with breakout session. pre self assessment and post self assessment.','I need to learn more about the modules.',10,'The bootcamp is one way of learning, specially if there is something new. EL is something new to us, teachers should attend the training to master the knowledge of the teaching pedagogy and its implementation. Nobody can\'t teach what they don\'t have.','I wish the District could also offer us an advance training to learn more about this curriculum and required all teachers who are using the curriculum to attend.',8,9,6,0,0,'Module assignment and self reflection.'),(11135,1593662400,'West Contra Costa USD, CA','Teacher or specialist',3,4,2,4,4,4,'I am more familiar with the curriculum. I feel more confident and knowing what to teach and the best way to implement the information.','I am excited about the 4Ts and RTTW.',4,4,4,0,0,'I liked the screen share slides.','I thought it was too much homework. the short answers where we had to respond to others was good but then we had to submit more work was tough for me to stay focused.',7,'It was a lot of information in a short amount of time. The information is useful.','',8,9,0,0,0,'I liked the breakout rooms. It was helpful to talk with other to get ideas.'),(11136,1593662400,'West Contra Costa USD, CA','Teacher or specialist',4,5,4,4,5,3,'I learned the basic structure of the curriculum and how to use it, but not how to adapt it to a virtual world.','Following the lessons such that they force me to consistently reinforce strong protocols.',3,5,5,5,5,'Wonderful community, wonderful positivity. The content covered was deeply relevant, but we talked about them in a broader sense that made us think about more than just the letter of the curriculum.','More talk about adapting to an online format. Maybe some calendering?',9,'Even for teachers with experience, and I can\'t think of any better way for them to get to know the model. (It\'s not a 10 because some teachers don\'t want to know the curriculum models all that closely).','',8,3,20,0,0,'The unboxing procedure.'),(11137,1593662400,'West Contra Costa USD, CA','Teacher or specialist',5,5,5,5,5,4,'Learning targets and understanding the shifts and the context','Shifts in literacy',5,5,5,0,0,'Collaboration with others. Understanding the shifts more fully now.','Wish we had posters to work together and share our findings.',9,'This PD was very beneficial for helping implement the new program. The information was great.','',8,9,0,0,0,'Working in small groups with others. Especially looking at performance task and lessons.'),(11138,1593662400,'West Contra Costa USD, CA','Teacher or specialist',3,2,4,3,3,2,'I wish there was more focus on how to prepare for school opening in the Fall. There was some mention, but I still felt like we could\'ve dedicated a whole session or half a session to resources/ what structures and protocols we can use for online learning.','I am excited to try out the RTTW cycle in my classroom!',4,4,4,4,4,'I liked the focus on the bigger picture of things and the WHY behind the curriculum.','I really wished we had more support with looking at the curriculum, and what planning should look like. Maybe even a modeled lesson. I still feel lost. I feel like this was more of a PD that was a \"buy in\" on this curriculum, and not so much tools to using it.',5,'If you want to know more about the WHY in the curriculum, and have more collaboration I think this is great. But, as someone with no clue what is going on or what EL really is, things didn\'t feel as helpful. I do feel excited to begin this curriculum, but I also feel overwhelmed because I don\'t know where to start.','',8,6,9,0,0,'The calls were most helpful in my learning!'),(11139,1593662400,'West Contra Costa USD, CA','Teacher or specialist',5,5,4,5,5,4,'Discussions with other teachers, Justin\'s ideas, collaboration.','I am most excited to try out collaboration on google classroom.',5,5,5,0,0,'Collaboration with other teachers. Justin\'s lessons.','n/a',9,'It gives you insight into the EL curriculum.','',8,6,0,0,0,'Working with other teachers to talk about the curriculum.'),(11140,1593662400,'West Contra Costa USD, CA','Teacher or specialist',3,3,3,3,4,4,'I am familiar with the curriculum that I had never heard about until a month ago.','I like the idea of studying human rights since this is such an unjust period of American history.',3,3,3,3,3,'I liked the concept of student enpowerment.','Put the book in our hand.',5,'I\'m burned out from the school year and the idiot president. I think everyone needs a break.','',8,6,9,0,0,'Personal learning through reading and docs.'),(11141,1593662400,'West Contra Costa USD, CA','Teacher or specialist',5,5,5,5,5,5,'The intro to the new EL was tremendously helpful in preparing me to implement the curriculum in any setting (in school, virtual, hybrid)','Implementing EL with integrity. It will be the foundational curriculum I use this coming year and take the bulk of my instructional time in ELA',3,5,5,5,5,'Great group of teacher and wonderful facilitators. I was very impressed with the online Teaching Lab design. Good mix of activities- very strategic.','In person :)',10,'The EL curriculum is excellent, but can be overwhelming. I believe this bootcamp is essential to help teachers successfully enter into teaching the program.','',8,3,20,0,0,'Hard to choose'),(11142,1593662400,'West Contra Costa USD, CA','Teacher or specialist',5,5,5,5,5,5,'I am much more confident in how the curriculum works and was able to gather a lot of online resources that will help, if we continue with virtual learning!','I\'m really excited to think more about unpacking each module and looking at how the read, think, talk, write cycle fits into each lesson and unit.',5,5,5,5,5,'Justin did a fantastic job of facilitating our group. He was amazing at answering all questions and made everyone feel very comfortable.','I would have loved to have more time to dig into everything deeper!',10,'I thought the PD was very informative, fun, and well balanced.',