ort without using modifications for my students with special needs, as well as collaboration with the staff.',4,4,4,4,4,'i learned about the EL curriculum, and now I know how to support the Gen Ed teacher in implementing and differentiate instruction to struggling students,','Knowing and understanding the EL curriculum made an impact on my teaching experience, It is a real challenge as a special ed teacher to guide and support struggling students in their reading, thinking, talking and writing skills and ability.',9,'It is very informative and it covers the necessary skills that are essential for students to be successful in their academic endeavor towards college.goals.','Thank you for all the support.',8,6,9,0,0,'The protocols, close reading, then the scaffolds and support materials to augment students learning.'),(11158,1593662400,'West Contra Costa USD, CA','Teacher or specialist',5,5,5,5,4,3,'During breakout groups others were helpful in offering insight into how they have taught the curriculum online. Justin also offered a few resources that will be helpful to utilize if we teach virtually next year.','I am excited to collaborate with my grade level teammates now that we all have the same understanding about the intentions behind this curriculum and how to appropriately deliver lessons.',5,5,5,5,5,'The opportunity to learn how to backwards plan and internalize lessons.','More time to plan for lessons and utilize collaboration time with other teachers in our district.',9,'This is one of the most informative EL trainings I have attended. It was focused and intentionally built to support the planning of this curriculum.','',8,6,9,0,0,'Planning documents and explanation of protocols/language dives.'),(11159,1593662400,'West Contra Costa USD, CA','School-based administrator or supervisor',5,5,5,5,4,4,'This course was very helpful in helping me to think more about how to support the teaching of EL virtually.','I look forward to seeing the RTTW process play out in real time.',5,5,5,0,0,'It was great to dig into the content before and after the live session. I felt like I had ample time to explore.','It all went really well.',10,'The whole process was well planned and structured. I seem to learn well this way.','',8,9,0,0,0,'The guided practice and assignments helped me to better understand how to effectively plan for instruction.'),(11160,1593662400,'West Contra Costa USD, CA','Teacher or specialist',5,5,5,5,5,5,'It refreshed my memory on the salient points in the modules.','The conversation cues, language dive, protocols.',5,5,5,0,0,'The articles and the videos were great.','Maybe more videos will be great.',9,'It was comprehensive.','no',8,9,0,0,0,'The break out sessions were great, l had a chance to work with other teachers.'),(11161,1593662400,'West Contra Costa USD, CA','School-based administrator or supervisor',5,5,5,5,5,5,'We are committed to this curriculum so now I can order the materials and plan to support the teachers.','I am excited to see the final module tasks.',5,5,5,5,5,'I think the moodle platform was excellent in getting us primed. I also like from the outset that there was a strictness about turning in assignments and attending sessions, this created a respect and seriousness for everyone\'s time and we all benefited from it. I love that I worked with the same grade level from other schools. Timing and pacing was great.','??',10,'Everything from the pre-work to the facilitation of the meetings was excellent and useful.','I am hoping for additional training to support teams with mapping out their precious collaboration time. I want people to have an idea of how and what they will collaborate about and what is an individuals responsibility.',8,3,20,0,0,'The pre shifts/post shifts activity with the greek myth really made us experience the difference of giving context to enhance the comprehension of complex text. I think from then on I knew this training would be excellent.'),(11162,1593662400,'West Contra Costa