hings are laid out. If I was a new teacher having to teach EL doing the virtual bootcamp, I personally feel it would be very hard. They don\'t know the vocabulary EL uses. So I would recommend the PL to a teacher who has taught EL before to get better understanding of the material, everyone needs a refresher. But a new teacher I would not reccommend, they would become overwhelmed.','',8,9,6,0,0,'I think doing the reading before we met online during zoom helped me to understand what I needed to discuss with my grade level during the zoom breakouts.'),(11172,1593662400,'West Contra Costa USD, CA','Teacher or specialist',4,4,3,4,4,3,'I don\'t feel it has really help with school opening after covid-19. There are still many questions to be answered.','I am excited to try out the scaffolds, especially conversation cues.',1,4,4,4,4,'The zoom calls went well and once I figured out Moodle that was fine too.','Understanding how to navigate Moodle and being able to use google docs to share documents.',8,'It depends on what the friend needs training for. This is a great first time to EL training, and I appreciated the refreshers.','',8,9,6,0,0,'The unpacking box, and planning scaffolds'),(11173,1593662400,'West Contra Costa USD, CA','Teacher or specialist',4,5,4,4,3,4,'The focus on equity and the support and resource materials to help students achieve','The focus on the shift to the three dimensions of student achievement',4,4,3,0,0,'The materials and the modules','The system of uploading responses to the assignments and the sequence and presentation of tasks to be accomplished in the module platform',8,'The presentation can still be improved.','The content is very enriching but it became quite taxing.',8,6,0,0,0,'The reflections'),(11174,1593662400,'West Contra Costa USD, CA','Teacher or specialist',4,4,4,3,3,3,'review of scaffolds and supports','language dives',3,4,4,0,0,'assignments','navigating the teaching lab site',8,'overall the course was valuable for a teaching impleme