art to better meet the needs of the students',4,5,5,0,0,'The organization of the zoom meetings','Nothing',9,'It was not only an easy way to learn the material, but I was able take away knowledge from the meetings.','',15,15,0,0,0,'The breakout sessions were very helpful - the ability to talk to colleagues about instructing FS in a small group setting. The videos that we were watching also helped my understanding of what the expectations were during the small group time.'),(11292,1592280000,'Pointe Coupee Parish, LA','Teacher or specialist',5,5,5,5,5,5,'It helped to prepare the students socially and emotionally.','Initially implementating small group instruction before whole group instruction.',5,5,5,5,5,'The entire presentation has gone well.','Not applicable',10,'The professional develop has been amazing. I loved hearing the great ideas from my colleagues.','No',31,26,27,2,0,'Action planning'),(11293,1592452800,'Fort Dodge Schools, IA','Teacher or specialist',4,3,3,3,3,3,'More examples of how to do this virtually','Having more freedom in small groups is exciting but also a little scary',2,4,4,4,4,'I was able to still connect with my peers for help','More assistance in lesson planning for SG & WG. I think I struggle with the freedom somewhat vs what we previously used for foundation skills',7,'I feel that I still have gaps in learning and that will only come with time of teaching the materials','Some of the homework activities were a lot of work especially when doing it by myself (I do not have a grade level team). Some of the 5 or 10 minute breakout sessions to discuss during zoom calls were a little excessive in time allotments.',15,15,35,0,0,'videos of it in action'),(11294,1592280000,'Pointe Coupee Parish, LA','Teacher or specialist',4,4,5,5,4,4,'I gives me an idea of how distance learning will take place','Different participation methods',4,5,5,5,5,'Most everything went well. No major issues','a little more coordination would be a plus',8,'it was an excellent p