s.',5,5,5,5,5,'Zoom was better for me today. The information I received was great also.','none',10,'Very good information to go back to my classroom to use.','',31,26,27,2,0,'I enjoyed the small group breakout discussions.'),(11301,1592280000,'Pointe Coupee Parish, LA','Teacher or specialist',5,5,5,5,5,4,'prepared me to plan with sped counterparts','planning with sped',4,5,5,5,5,'working with others','more explicit instructions',10,'I have loved every minute of this bootcamp and I feel very prepared to better help my students','',8,26,27,0,0,'having a note catcher'),(11302,1592452800,'Fort Dodge Schools, IA','Teacher or specialist',5,5,4,4,4,5,'Helped me organization and thinking about how that would work virtually','Organizing independent activities',5,5,5,4,5,'Adrienne really made herself available and worked hard to help us. I reached out to her and she is so easy to talk to you.','Being together in person!',10,'Just the ease of working with Adrienne and Spencer. She was able to relate to us using her classroom experience. She is so easy going too.','',15,15,35,0,0,'Collaborating with other teachers'),(11303,1592452800,'Fort Dodge Schools, IA','School-based coach',5,5,5,5,5,5,'I love how Adrienne modeled lessons virtually that really helped us see what it could look like virtually.','the ability to use the assessments along with the phases/microphase chart and the assessment conversion chart to best meet students needs.',5,5,5,0,0,'Everything the content and deliver was just what our district needed!!','to be in person... but it was really good for online!',10,'Excellent content and delivery!','',15,15,0,0,0,'the videos, examples, and experientials'),(11304,1592452800,'Fort Dodge Schools, IA','Teacher or specialist',5,4,4,5,2,4,'More explanations on what I struggled with this past year during my time piloting skills. There are still a few areas I am nervous about but overall it was beneficial and helping me with learning more about the skills curriculum and struc