h other teachers. At the end of this we do not know the \"how\" of the curriculum and that is what I was looking forward to so that I give my students the best.','More student centered learning and collaborating with other teachers.',5,4,3,4,3,'Zoom meetings','Much more time in Zoom meetings discussing curriculum, listening from the experts, more sharing with each other and more on implementing this program. I feel like 90 percent of the workshop took place on our own, without a lot of instruction. I wish it would have been more like a up close and personal workshop, like I am familiar with.',5,'The presenters were great; the workshop itself left me wishing for more information about how to teach the material. That part was disappointing.','',8,20,34,0,0,'watching videos of actual classes and learning taking place'),(11322,1591761600,'Calcasieu Parish, LA','Teacher or specialist',5,5,5,5,5,5,'Thinking about teaching this new unit and which lessons to set up as synchronous and asynchronous.','Just the teaching of the new 3.0 unit as a whole',5,5,5,5,5,'The breakdown of the new unit, navigating of the new resources.','More time to dissect the lessons and unpacking targets',9,'It is essential if people are going to teach from this new platform and these new units.','',6,32,29,8,0,'Breakout groups/discussion'),(11323,1591761600,'DeSoto Parish, LA','School-based coach',3,3,3,3,3,3,'Just doing Zoom was a learning experience!','Building communities in the classroom',5,5,5,5,5,'working through Moodle at my own pace','More precise model used inside the LZ platform',7,'Needed a clear model inside LZ','',8,20,34,0,0,'Moodle Platform'),(11324,1591761600,'Calcasieu Parish, LA','TAP Master teacher',5,5,4,4,5,3,'I’m still unsure how school will look in the fall, virtual vs face to face, but that is something that has yet to be determined','Living the lessons as a student',5,5,5,0,0,'The collaboration with my same grade level teachers','Being able to print out the teacher notes',10