pports and scaffold for all learners'),(11373,1591761600,'DeSoto Parish, LA','Teacher or specialist',4,4,4,4,4,3,'It did give an example of what a virtual class lesson could look like.','I am excited that all materials are provided so my time can be spent planning for my students not gathering material.',3,4,4,0,0,'The material was presented clearly and effectively.','It not being virtual.',8,'It was a great overview of not only the curriculum but also the values and goals behind the company.','',8,34,0,0,0,'The sessions'),(11374,1591761600,'DeSoto Parish, LA','Teacher or specialist',4,5,4,5,5,3,'I feel that this course has taught me many things about the new curriculum and how to implement it in the classroom with the students present. Not sure how this curriculum would look in a virtual setting and praying I don\'t have to use it that way!','I am most excited to see the difference in using text dependent questions rather than questions based off of prior knowledge. Especially when using more complex texts. I just can\'t wait to see how much deeper I can get the kids to think!',4,5,5,5,5,'I think the course went well. They did a great job explaining and helping us to connect with other teachers during the training.','In these times where we can\'t be face to face I think they did the best job possible.',10,'I really enjoyed the course.','not at this time.',8,34,20,0,0,'I think the reflections help me most.'),(11375,1591761600,'DeSoto Parish, LA','Teacher or specialist',4,4,4,4,4,4,'Get familiar with the materials','implementing in the classroom',4,4,4,0,0,'zoom','in person',8,'na','',8,34,0,0,0,'modules'),(11376,1591761600,'DeSoto Parish, LA','Teacher or specialist',2,1,2,2,3,1,'It did not, I recommended that there by more info on this in the beginning. We don\'t know how to lower the curriculum and truly meet students where they are after COVID.','language dives',2,2,2,2,2,'not much to be honest','Add more work with the actual curriculum, have someone show a lesso