om class.','I\"m excited about the supports embedded in the lessons and the habits of character.',5,5,5,0,0,'The organization of the meeting was impressive and easy for me to follow. I\'m not the best with computers, so I appreciate being able to navigate it so effortlessly.','Im not sure since this is all new to me. I thought it went well.',8,'I really enjoyed the PD and found it all very useful.','',8,34,0,0,0,'Diving into the actual lessons helped more than anything.'),(11382,1591243200,'Fort Dodge Schools, IA','Teacher or specialist',4,4,5,5,3,4,'more in depth understanding of the why behind the curriculum','module unpacking',5,4,4,4,4,'zoom calls','the moodle was hard to use for me.',5,'moodle was hard to navigate','',8,6,3,0,0,'zoom calls'),(11383,1591243200,'Fort Dodge Schools, IA','Teacher or specialist',3,4,4,4,5,4,'It has given me clarity on the curriculum.','Conversation cues and protocols',5,5,4,4,4,'It went well considering the circumstances. Meetings were well organized and flowed.','Face to face - which could not have been an option',8,'I liked the break out groups but was not put in the group with the 6th teacher I will be working with. I was put into random groups that didn\'t make sense.','',8,6,3,0,0,'Working in the break out groups/ independent reading'),(11384,1591243200,'Fort Dodge Schools, IA','Teacher or specialist',2,3,5,5,4,1,'I don\'t think this course was designed to help with school after covid.','Teaching Protocols and having my students productively engage in RTTW.',5,4,5,2,4,'As much work as the modules seemed like in the beginning, I learned a lot about the \"why\" of the EL curriculum. There are so many facets to this complex curriculum but the rewards will be great.','Better technology knowledge with the chrome book.',7,'I was hoping to have more knowledge of actually what to do to prepare a day to day lesson. After unpacking the assessment, where do you start? There are 3 resources and some of the lessons are dozens of pages with a lot of preparation materials, check lists for students and teacher etc. After learning the why I needed more modeling of how.','No',8,6,3,0,0,'Reading and re-reading, taking notes on everything...I was starting from square one.'),(11385,1591243200,'Fort Dodge Schools, IA','Teacher or specialist',4,5,5,5,5,1,'Not sure','RTTW',4,5,5,5,5,'Getting help when it was needed','Finding material on Moodle',7,'Because it gives a better understanding and background of the curriculum.','',8,6,3,0,0,'The breakout groups'),(11386,1591243200,'Fort Dodge Schools, IA','Teacher or specialist',5,5,4,5,5,4,'It demonstrated different methods, protocols and strategies.','I learned that their are many supports that I can use with my students.',5,3,5,5,5,'The team work, camaraderie of the teachers and participants, and support from the EL staff.','Nothing',10,'I chose this rating because of the support that Justin and Tara provided for the participants. Thank you to both of you.','no',8,6,3,0,0,'There was a great deal of knowledge about the curriculum and the supports that it supplies for lower ability students.'),(11387,1591243200,'Fort Dodge Schools, IA','Teacher or specialist',4,5,5,5,5,5,'I learned more about the virtual tools and technology a little bit to possibly work with students.','I am excited to make more use of anchor charts and Language Dives.',5,5,5,5,5,'The amount of guidance and support for learning this curriculum.','I was nervous at times because I was not always clear on how to be on a zoom call and have a document pulled up on my scree. I felt better when the facilitators shared their screen.',10,'These are real educators that work with this curriculum in the classroom. If teachers are to be trained to teach a curriculum it definetely should come from real teachers who have been in the classroom in recent years.','Appreciate these two facilitators.',8,6,3,0,0,'Break out sessions where we shared and listened to each other\'s ideas.'),(11388,1591243200,'Fort Dodge Schools, IA','Teacher or specialist',5,5,5,5,5,5,'more understanding','protocols',5,5,5,5,5,'communication','na',10,'well done and knowledgeable','na',8,6,3,0,0,'supports and scaffolds'),(11389,1591243200,'Fort Dodge Schools, IA','Teacher or specialist',5,5,4,5,5,5,'Virtual classroom practice...','Shifting',3,5,5,5,5,'As complex as this curriculum is, I\'m so appreciative that we broke things up.','Better internet and computer...',10,'Because this course was very helpful.','Thank you for taking the time to help us with this curriculum. There are so many benefits to it. This course can help us maximize the impact of learning with the least amount of struggle. It\'s working smarter and not harder.',8,6,3,0,0,'All of it.'),(11390,1591243200,'Fort Dodge Schools, IA','Teacher or specialist',4,4,4,4,4,3,'I feel more confident with what I am dealing with. I would like to see it actually taught in the middle school level.','The backwards design- digging into the assessments where I can now actually see the different pieces that EL has built within.',4,4,4,4,4,'The entire school was able to dive in and really try accept this training- even with the bad taste a lot of people have of EL.','I wish I could see this taught in the middle school level.',7,'If I could see it actually be taught, I would be sold even more. I wish I knew teachers who have the students read for homework and how they were able to get their students to accomplish this- or what happens to those who do not read. I have a hard time when students don\'t read and this is heavily about reading.','',8,6,3,0,0,'the three squares of the assessments. I hope my school has us do this in our own PLC\'s'),(11391,1591243200,'Fort Dodge Schools, IA','District/network/state-level professional or administrator',4,5,5,5,4,5,'Feel better prepared to support teachers in implementation','Looking for signs of people visions as I am in classrooms',5,5,5,5,5,'Like both the synchronous and asynchronous learning opportunities','Nothing, I just need to spend more independent time reviewing and familiarizing myself with the materials and texts',10,'It is extremely beneficial and well planned','',8,6,3,0,0,'Loved the shifts activities so much and the opportunity to dig in to the materials'),(11392,1591243200,'Fort Dodge Schools, IA','Teacher or specialist',4,4,4,4,4,3,'Begin with a vision and understand the foundation of the EL curriculum.','Backwards design and creating a vision with my students.',5,4,4,4,4,'conversations with colleagues, learning about the foundations of the EL curriculum.','More time',8,'It was a great deal of work and just think more time would have been beneficial.','',8,3,6,0,0,'The independent work and collaboration with colleagues.'),(11393,1591243200,'Fort Dodge Schools, IA','District/network/state-level professional or administrator',4,3,5,5,3,2,'We didn\'t discuss this topic.','Planning and sharing data with PLC groups.',4,3,3,3,3,'Communication of content.','It was hard to follow which materials we needed during Zoom meetings. Some of the Moodle activities were difficult to understand/ navigate.',8,'The content is very helpful in giving an overall view of the curriclum.','',8,6,3,0,0,'Working through the modules.'),(11394,1591243200,'Fort Dodge Schools, IA','School-based coach',5,5,5,5,4,3,'It helped me understand EL in general, especially the design of the curriculum. This format also gave me ideas on how to teach virtually,','The RTTW protocol and the supports available for students.',3,5,5,5,5,'The asynchronous work was the perfect amount to help me learn without being overwhelming.','N/A',10,'I learned an unbelievable amount in a short amount of time.','',8,6,3,0,0,'I enjoyed the breakout rooms to hear from my colleagues.'),(11395,1591243200,'Fort Dodge Schools, IA','Teacher or specialist',5,5,5,5,5,4,'It has provided me an oppotunity to see the curriculum through a virtual route so I know what it looks like if we have to do this again.','I am most excited about trying different protocols, conversation cues, and different differentiation methods to help my struggling students succeed.',4,5,5,5,5,'The engagement throughout the Zoom meetings and the Moodle page.','N/A',10,'I thought it was very engaging and informative, while learning from other colleagues at different grade levels.','This was a great experience and I feel more confident with this curriculum! Thank y\'all so much!',8,6,3,0,0,'The activities where we broke out into break out groups because it felt like we were viewing things from a student perspective.'),(11396,1591243200,'Fort Dodge Schools, IA','School-based coach',5,5,5,5,5,5,'I have a better understanding of how to access the supports and where. I have a better understanding of how everything is connected to the performance task, along with the importance of backwards planning. I learned more about the implementation of the RTTW and will be better prepared to teach when I return to school.','Continue with the RTTW framework with more intensity and consistency. Digging deeper when backwards planning. Pushing the protocols and learning more about how to use the supports provided in each lesson.',4,5,5,5,5,'It was helpful to have the assignments and articles to read before zooming, so we were able to process the information and contribute more to the group discussions.','Next time, having smaller grade level groups to dig deeper into the modules.',10,'We can use this time to better plan','Great work and I appreciate how thorough you both were!',8,6,3,0,0,'The zooms and group talks (breakout rooms). The parking lot was helpful, too.'),(11397,1591243200,'Fort Dodge Schools, IA','Teacher or specialist',4,4,3,3,3,2,'There wasn\'t a particular focus on how to re-orient students to the classroom following Covid-19.','Personalizing lessons',4,4,4,2,3,'Learning how to navigate curriculum materials','More small activities to complete independently',7,'Because it\'s a great guide for first-year teachers!','',8,6,3,0,0,'Shifts elevator pitch'),(11398,1591243200,'Fort Dodge Schools, IA','Teacher or specialist',4,4,4,5,4,4,'Just knowing more about the curriculum','All the supports',4,4,4,4,4,'Our discussions','Being in person',6,'It was good, I\'m just not great with technology','',8,6,3,0,0,'Our discussions'),(11399,1591243200,'Fort Dodge Schools, IA','Teacher or specialist',4,4,4,4,4,4,'I would love to have these trainings in person before a school year starts and not at the end.','Planning with my PLC.',5,5,5,5,5,'The collaboration with other teachers and getting on the same page as a school.','In person learning',7,'It was helpful but some may find it to be a lot of work.','',8,6,3,0,0,'Breakout groups'),(11400,1591243200,'Fort Dodge Schools, IA','Teacher or specialist',4,4,3,3,4,4,'I better understand to help meet the needs of my students.','The different supports that are provided.',4,4,4,5,4,'Communicating with other professionals about what questions we have or what our thoughts are.','If there were more activites toward special education teachers.',8,'Information was clear and I was able to communicate with other coworkers to discuss our thoughts.','',8,3,6,0,0,'The meeting the needs of all learners activity.'),(11401,1591243200,'Fort Dodge Schools, IA','School-based coach',5,5,5,5,5,4,'Spending time diving into the scaffold and supports built into the curriculum and offered in each lesson will help us meet the needs of ALL our students when we are back on-site learning together.','Embedding more layers of appropriate support to reach all learners.',5,5,5,5,5,'Asynchronous work set the foundation for diving deeper and making connections in our zoom calls.','More face-to-face time',10,'Engaging, content rich, community environment of learners, skilled facilitators.','',8,3,6,0,0,'Module unpacking and lesson unpacking for scaffolds'),(11402,1591243200,'Fort Dodge Schools, IA','School-based administrator or supervisor',5,5,5,5,5,5,'Hit the ground running when we get back','Planning and preparing with teachers',4,5,5,5,5,'Facilitators did a great job with the Zoom','More hands on things that we would\'ve been able to do had we met face to face, or had students to try things with',9,'Valuable training','',8,6,3,0,0,'Listening to the experts break things down'),(11403,1591243200,'Brownington Central School, VT','Teacher or specialist',3,4,4,4,1,2,'I don\'t know how we can build collaboration and community with students virtually. Very difficult without body language.','I am a special educator. I am most excited for inclusion.',1,4,2,0,0,'It was a basic overview.','I am from VT and would have liked to have more discussion/processing time with my colleagues. Buy-in is key and I know that not everyone does.',2,'I am brand new to EL and it seemed like I was supposed to already have experience with it. I found the Zoom/Moodle experience to be scattered and non-sequential. There were quite a few times that I felt like I had missed something---an assignment or other. When I went back to review the assignments, I had not missed anything. I needed less time with you trying to convince me the importance of PD and more time on the actual unpacking of the curriculum. You called it \"unpacking\" but it never felt that way. Another issue was when we were broken into chat rooms. An example was the other day (I don\'t remember the assignment), but we were supposed to spend 10 minutes on the first topic, 10 minutes on the 2nd topic and 2 minutes on the final summation. I had written this down when we were given the verbal instructions. The chat room time was only given around 10 minutes for the whole thing. Frustrating. I could have gotten the same knowledge by reading the teacher\'s manual and unpacking on my own first. Then I would have loved to have your expertise to help me understand more fully and answer my questions.\n \n The other issue for me is that many of the videos you had us watch were from charter schools and independent schools rather than public schools. Students behave far differently when they are in uniform or in an all girl\'s school.','You are clearly very knowledgeable and a believer in this curriculum. I appreciated your exuberance.',8,9,0,0,0,'Reading and reflecting'),(11404,1591243200,'Louisville School District - Jacob Elementary, KY','Teacher or specialist',4,3,4,4,3,4,'This course helped to understand the foundational components of EL Education. Next step will be to get actual materials in hand and begin collaborating and planning.','Conversation ques will help facilitate talk among my students.',1,4,4,0,0,'Breakout rooms seemed to be effective with such a large group.','Spending more time on the actual materials and having hard copies of them would have helped me a lot.',8,'It was very informative and could be done from your home.','',8,9,0,0,0,'Diving in and looking at the materials supported my learning.'),(11405,1591243200,'Louisville School District - Jacob Elementary, KY','Teacher or specialist',3,4,3,4,4,1,'I do not feel prepared to implement this if we do not go back to school in a traditional way','I am most excited to have my students dive deeper into their learning and to collaborate more with one another.',1,4,4,4,4,'I was able to learn and collaborate in a virtual setting','To have the physical materials in hand',4,'I would have to implement it first','no',8,9,20,0,0,'Diving into lessons and watching videos of other teachers classrooms'),(11406,1591243200,'Louisville School District - Jacob Elementary, KY','Teacher or specialist',4,4,4,4,4,3,'This was an introduction to our new reading program . It offered a look into what we will be doing. But I am really looking forward to having the materials in front of me.','Putting it all together and seeing how my students grow. I really look forward to how there is a character element to the program.',3,4,4,0,0,'I enjoyed the breakout rooms and being able to discuss things in a small group.','Being able to meet in person, but since that was not possible, this was the next best option. Also, it was occurring while I was still teaching NTI - so it was difficult fitting all the zoom meetings and the course work in while still trying to keep up with my classroom requirements. So my only other suggestion would be to have the Bootcamp at a different time.',7,'I like what I learned about your program and feel like it will be beneficial to my students.','no',8,9,0,0,0,'When working in a small group and discussing a topic.'),(11407,1591243200,'Louisville School District - Jacob Elementary, KY','Teacher or specialist',3,3,3,3,4,3,'I feel uncertain about how we will do this if we don\'t go back in the fall.','Uncertain, I don\'t know how this is going to work with the EBD self-contained class if we do go back? So many disruptions to teaching and learning with this group of students.',1,3,3,3,4,'No problems with virtual learning, just the platform was difficult to navigate the first few lessons.','Direct links to the materials we need for the Modules instead of making us search for them. Without the actual books to \"touch\" it was unnecessarily/VERY time consuming to find the right resources on the platform',5,'It was too time consuming. I had alot of work to wrap up since May 18th and I felt overwhelmed having to take this on, as well.','',8,9,20,0,0,'Working in small break outs was best for me, especially when looking for the materials on the platform.'),(11408,1591243200,'Louisville School District - Jacob Elementary, KY','Teacher or specialist',5,5,5,5,3,5,'This course has taught me how to implement the EL curriculum. It has given me a headstart on the school year.the EL curriculum the EL curriculum.','The think pair share with all of the learning.',1,5,5,5,5,'I think the fact that we had to do all of the assignments out of class and then reviewed them in class.','If we had been in person with books and not virtual.',8,'I would\'ve given it a 10 if it hadn\'t been virtual.','I put someone other than Kristen Briggs because her name was not on the list.',8,9,20,0,0,'The assignments'),(11409,1591243200,'Brownington Central School, VT','Teacher or specialist',5,5,5,5,5,2,'That was actually the question that I was just thinking about. How to have the collaboration if we have to have remote learning. I think have break out rooms could work. That adds another layer of complexity in my brain right now! We will make it work because we alwys do!','I am the most excited for the labs work I think!',4,5,5,5,5,'I actually liked using the moodle learning lab. I enjoyed how it was set up and easy to use. I enjoyed the variety of tools that the facilitators used even through only an online learning platform.','Having some more school time to figure it out for us!',10,'I just enjoyed the set up, conversations, learning and excitement from this training!','Thank You!',8,9,20,0,0,'Breakout rooms were great!!!!!'),(11410,1591243200,'Louisville School District - Jacob Elementary, KY','Teacher or specialist',5,5,5,5,5,5,'I am more familiar with the curriculum we will begin using.','Using complex texts with my students',5,5,5,5,5,'I thought the homework was very helpful in helping us become familiar with the resources.','In-person learning',10,'It was very thorough in acquainting us with the curriculum, but also the understanding and research behind its use.','',8,9,20,0,0,'I liked the breakout rooms where we got to share thoughts with other teachers.'),(11411,1591243200,'Brownington Central School, VT','Teacher or specialist',4,4,4,4,4,4,'understanding of how to use the program with my special education students','developing a reading program with my students that teach more skills',1,4,4,0,0,'Having the material to look at as we explored','being in person for sure',9,'I believe the information is important the program will benefit students','',8,9,0,0,0,'hands on'),(11412,1591243200,'Louisville School District - Jacob Elementary, KY','School-based administrator or supervisor',5,5,4,4,5,4,'It has prepared me for how to assist and coach my teachers in EL Education.','Watching the engagement of the students.',5,5,5,5,5,'The Moodle allowed us to read and engage in the learning.','To have the books in front of me',10,'It was a great experience','No',8,9,20,0,0,'Moodle'),(11413,1591243200,'Louisville School District - Jacob Elementary, KY','Teacher or specialist',4,5,4,4,3,3,'I know what I need to be implementing when schools open back up after COVID-19','I am most excited about utilizing the materials to implement purposeful, interesting, rigorous lessons, that have an end goal and incorporate multiple standards from across subject areas.',3,4,4,0,0,'Diving in the modules to learn how and what we will be implementing.','I would like to have had more discussion about the character building aspect of this curriculum',8,'I chose this rating because overall the EL presentation was successful even virtually','None at this time',8,9,0,0,0,'The reflections and discussions among peers'),(11414,1591243200,'Louisville School District - Jacob Elementary, KY','Teacher or specialist',3,3,4,3,4,3,'I am now familiar with the teacher\'s guide, supplemental materials, and video library for EL Education through openupresources.org.','Learning how to plan for EL Education. it is not a script I can just pick up on day 1 and read. It takes a great deal of planning and preparation.',2,4,4,0,0,'Moving through the EL Materials such as the modules and units, as well as discussion of the protocols and support. Mandi always quickly replied to emails. She and Kristen provided links to supports in chats during training.','More time to work with grade level team on the module and unit planning. A great deal of learning and preparation happens here. Providing an example in the Module Unboxing the way they did in the call for the Unit Unboxing. I think less time should be spent in learning about teaching lab and how they do business and more time should be spent really getting familiar with the materials and viewing more examples of EL in the classroom and having time to debrief about that. I also think less time should be spent going over the non EL materials and responding in chat boxes (like the GIFs and the norms).',6,'I did get a lot out of it, but I believe a could have gotten so much more.','',8,9,0,0,0,'The module planning and discussion.'),(11415,1591243200,'Louisville School District - Jacob Elementary, KY','Teacher or specialist',4,4,3,3,4,4,'by working together for a common goal','Shifting the planning to become more collaborative',4,4,4,4,4,'The Zoom calls and being able to print out handouts','having the materials at hand (books)',3,'I do better in person','no',8,9,20,0,0,'videos'),(11416,1591243200,'Brownington Central School, VT','Teacher or specialist',4,4,5,4,3,2,'I feel like the course helped me to prepare to implement the program in a classroom, regardless of COVID-19.','The strength of the foundation of the 4Ts as it will provide the source of information needed so I can spend more time tailoring the learning for kids',4,4,3,0,0,'The independent learning requirements really helped to support what we need to know going forward. We have a foundation of knowledge to begin planning our instruction.','Working with members of our school alone, as the combination made it more challenging to share and tailor what we need to know for our school and students. The team work together would have been more beneficial and a better use of our time, even if just in break out rooms.',6,'I do not know of any other schools who are considering using EL.','',8,9,0,0,0,'The independent work and then the review as a whole group, pointing out the key ideas in our learning.'),(11417,1591243200,'Brownington Central School, VT','Teacher or specialist',4,4,4,4,3,3,'Not knowing what school is going to look like, makes this difficult to answer. I am hoping that no matter what comes in the fall, this knowledge of EL will help me to meet students\' needs.','I really want to try out the lessons and dig into the actual texts and tasks! I also want to practice letting the text be the teacher.',4,4,3,4,3,'Overall, the content flowed pretty well, considering glitches and the whole online experience.','More time to dig deeper into the curriculum',8,'I think it is good for all teachers who are going to be using a curriculum to understand the why and how of its design.','',8,9,20,0,0,'Discussion with small groups'),(11418,1591243200,'Louisville School District - Jacob Elementary, KY','School-based coach',4,4,4,3,5,4,'I feel like I have a much better understanding of how to navigate and plan with the modules.','The backwards planning with teachers.',2,5,5,0,0,'I learned a lot about EL and feel much more comfortable with the curriculum.','To be able to work with our current grade level teams, and not be put in rooms with teachers we are not working with. More time actually working within the modules in breakout rooms.',8,'I think the EL curriculum would be difficult to implement if you do not have an understanding of the components and the way it was designed.','',8,9,0,0,0,'The module unpacking box template.'),(11419,1591243200,'Brownington Central School, VT','Teacher or specialist',5,5,4,5,5,5,'As long as we return to in person schooling, I feel ready. If we return to online schooling I will struggle with how to implement this curriculum.','I really can\'t wait to try the language dives. But honestly there are a lot of tips that I am taking away that I can\'t wait to try.',4,5,4,4,4,'For remote learning, this was done very well.','None',9,'I enjoyed it for being online','',8,9,20,0,0,'The breakout rooms were great! It allowed us to work in smaller groups.'),(11420,1591243200,'Brownington Central School, VT','School-based administrator or supervisor',4,4,4,3,2,4,'I will be able to supervise my teachers and help them prepare EL.','Watching the teachers refine their approach and set higher standards.',4,4,2,0,0,'The independent learning went well.','Some of the zoom sessions did not work as planned. Also, there were times when no one in the group understood the directions for a breakout. As the sessions went on, this became easier with linked directions.',9,'I have some new teachers that I hope to get this training this summer.','',8,9,0,0,0,'Videos, unpacking protocols'),(11421,1591243200,'Louisville School District - Jacob Elementary, KY','School-based administrator or supervisor',4,3,4,4,4,2,'Since we don\'t know what school is going to look like upon re-opening, right now it is difficulty to see how many aspects of this program (especially the collaboration) are going to be able to be used particularly if we return with strict social distancing measures in place or if we have to begin virtually.','I am most excited about the collaboration piece among students. I am also excited about the Character Ed portion.',3,5,5,0,0,'I think the time with the breakout rooms were helpful. It allowed us to work colleagues despite being in a virtual setting.','Having EL materials available in hand rather than digitally.',7,'The training was very helpful in introducing the EL program.','',8,9,0,0,0,'The materials, particularly the articles and videos, provided in the modules were very helpful!'),(11422,1591243200,'Brownington Central School, VT','Teacher or specialist',4,4,4,4,4,2,'It introduced the curriculum','The supplemental activities.',2,4,4,0,0,'The time spent in groups collaborating with peers from my school.','Working with my school more.',9,'It was really good, and the instructors did a good job.','',8,9,0,0,0,'Breakout Sessions.'),(11423,1591243200,'Brownington Central School, VT','Teacher or specialist',3,5,4,4,3,2,'I will now know how to effectively use the EL books and guides.','I am excited to actually implement the program and get started.',4,5,5,5,5,'Learning the nuts and bolts of the program.','The sight is really glitchy. Lots of technical issues.',5,'I wish I had more time with my colleagues to collaborate.','',8,9,20,0,0,'The moodle assignments and the break out rooms.'),(11424,1591243200,'Louisville School District - Jacob Elementary, KY','School-based coach',5,5,5,5,5,5,'Prepare for implementation of what it could possibly look like if virtual in the fall by completing the bootcamp virtually','Implementing the classroom supports and structures for our ECE population',3,5,5,5,5,'Kristen Briggs was the 2nd facilitator. I did not see her name as a choice under the list of options but completed the ratings for her that were relative for the 2nd presenter option.','Having hard copies of the materials (although I know this was a barrier due to COVID-19)',10,'The training fit the needs of our school to build capacity in the area of literacy.','',8,9,20,0,0,'The breakout rooms and having time to work with our colleagues.'),(11425,1591243200,'Louisville School District - Jacob Elementary, KY','Teacher or specialist',4,5,5,4,4,4,'It gave me resources to look over as we prepare','I am most excited about the building of knowledge through the modules and empowering my students through this process',2,4,4,0,0,'The ability to collaborate','Having the materials handy',9,'I feel that this will be extremely beneficial for our students and professional learning','NA',8,9,0,0,0,'I really enjoyed the videos so that I could see it being put into practice'),(11426,1591243200,'Louisville School District - Jacob Elementary, KY','Teacher or specialist',4,4,5,5,5,5,'The way in which I will teach the first module.','teaching the modules, seeing what the students create',3,5,5,5,5,'getting to do backwards planning for module 1','more time diving into modules',8,'I would rather it be in person.','',8,9,20,0,0,'breakout rooms'),(11427,1591243200,'Louisville School District - Jacob Elementary, KY','Teacher or specialist',3,4,4,4,4,3,'Starting fresh with a brand new curriculum that has structure will be beneficial for my students.','RTTW',2,4,4,0,0,'The Zoom calls and break out sessions went really well.','There was a lot of work to do outside the Zoom calls which did not allow much collaboration with your team or other colleagues. I also felt the Moodle activities needed to be explained better.',6,'I would recommend it not be virtual, but we could not help that. Mandi was a great host!','N/A',8,9,0,0,0,'Break out sessions'),(11428,1591243200,'Louisville School District - Jacob Elementary, KY','Teacher or specialist',4,3,4,5,4,3,'I hope this can help limit all the time I spend on trying to find the right materials.','Conversation cues and the other supports for my SPED students.',3,5,4,4,4,'The breakout rooms','n/a',10,'Even with computer work, it was very well formatted and I learned a lot.','',8,9,20,0,0,'The teaching lab.'),(11429,1591243200,'Louisville School District - Jacob Elementary, KY','Reading Intervention Teacher',3,2,3,3,4,3,'Teacher collaboration.','Community',2,3,5,0,0,'Having the opportunity to learn about the why behind EL.','This type of learning was new to everyone, so I don\'t want to sound too critical. I think that too much time was spent on how the curriculum was developed (which is important, but not necessarily what teachers new to the curriculum need) and not on actually digging in to the materials that they will be using in the classroom. I often felt that there was a disconnect between the coursework and the online sessions.',5,'See my answer for improvements.','I appreciate the hard work that went in to teaching this online course. Not only is it difficult to manage such a large group physically, Mandi did a great job virtually.',8,9,0,0,0,'Some of the learning tasks completed individually.'),(11430,1591243200,'Louisville School District - Jacob Elementary, KY','Teacher or specialist',3,3,3,4,4,3,'It helped introduce me to a new curriculum.','I am most excited to try out the teaching labs that come with the modules.',3,4,4,4,4,'What went well was having the ability to collaborate with teachers from another 