, which will help me as we go back to school. I do need to continue to look through all of the resources to figure out where everything is. I struggle with everything being in a google doc/folder.','Looking at all of the protocols and digging into the supports that are available for ALL students.',4,3,3,4,4,'Learning the \'why\' of this curriculum.','A couple of the breakout activities didn\'t have enough time to complete. It also was kind of confusing trying to find the resources we were supposed to be looking at...for example, looking at the un-boxing protocol. It was difficult (for me especially) to find where our lessons/modules were. This may have been a problem on my end as everything is online and in google docs.',7,'I chose this rating because unless my colleague or friend is teaching this curriculum, I am not sure why they would go through this professional learning.','I do wish there was more information available for teaching this curriculum in 6-8th gr block.',8,6,3,0,0,'I think I learned the most when we did the activity to help us understand the shifts.'),(11435,1591243200,'Fort Dodge Schools, IA','Teacher or specialist',4,5,5,4,4,2,'I do not know since know one really knows what our school will look like in the fall.','I am just excited to get started with it. I wish Covid 19 would not be an issue so we could start this in a normal school year.',5,5,4,5,4,'I thought this learning really did help me understand the philosophy of the curriculum, how it was set up, and how it was to be taught. I understand all the parts of this curriculum and how to make sense of it all. I feel better prepared to teach with it.','I think taking the teachers through a practice RTTW activity would have been helpful, so we could see and feel it in action.',8,'If a district is adopting this curriculum, this book camp really does help to see how everything fits together and how to teach with it. I taught a module 3 years ago and we had nothing like this to explain the curriculum. It was extremely difficult to teach with this curriculum. Now I am prepared.','',8,6,3,0,0,'The before the shift and after the shift learning also activities that took me into my grade level module.'),(11436,1591156800,'Calcasieu Parish, LA','Teacher or specialist',5,4,5,5,5,3,'Specific planning was discussed in group breakout sessions','Working on synchronous and asynchronous learning in lessons - planning and recording what is needed for students to beat learn material while in a virtual situation',5,5,5,0,0,'Meeting in chat room with other teachers to share','More specific information about technology and how detailed our lessons should be',8,'Jalinda did a great job','',6,32,0,10,0,'Same'),(11437,1591156800,'Calcasieu Parish, LA','Teacher or specialist',4,4,5,5,5,4,'Organizing my thoughts/ideas','I wouldn’t say I’m excited. I’m overwhelmed by the unknowns and moving parts.',4,4,4,0,0,'Getting to talk through ideas with my peers.','Having more time.',7,'I liked the breakout rooms.','',6,32,0,10,0,'Getting to talk through ideas with my peers.'),(11438,1591243200,'Fort Dodge Schools, IA','Teacher or specialist',4,4,3,4,3,4,'How to organize my learning the scaffolding for students','The strategies, scaffolding, and finding supports for all learners',5,4,4,3,4,'Hearing answers and thoughts from our colleagues','I was always behind a step or two . The reason is when we first started I thought we were to do our learning when we went to virtual meetings and I was not correct in that thought because we were to do the preview homework before the next meeting. I eventually got caught up but late. I know if I did the homework before the meeting I would have more of a success in learning the EL curriculum. I am not sure if you should make it more of a point to do the homework before the next meeting or I might have understood wrongly. I process a little slower than most which could have been my fault.',9,'If I was on board with all of the meetings ,I believe I would recommend the professional learning because even though I was behind I could understand as they talked.','',8,6,3,0,0,'the preview of learning coming up'),(11439,1591243200,'Fort Dodge Schools, IA','School-based administrator or supervisor',4,3,4,4,4,4,'gave us more chance for virtual collaboration.','As an administrator I am anxious to see it in action.',2,4,4,4,4,'I felt the collaboration and breakouts were well received and helpful.','Some of the assignments could have been geared toward administration.',8,'If I come across a fellow administrator who is planning on using the OER modules I will recommend it but it would work better face to face.','no',8,6,3,0,0,'I liked the discussion posts and replies.'),(11440,1591243200,'Fort Dodge Schools, IA','School-based administrator or supervisor',4,4,4,4,5,4,'Collaboration along with virtual learning.','Having a better understanding of the curriculum so I can better support my staff that are implementing.',5,5,5,5,5,'Ability to discuss things as a group.','NA',10,'Quality training','',8,6,3,0,0,'Time for collaboration'),(11441,1590984000,'Calcasieu Parish, LA','Teacher or specialist',5,5,3,3,5,5,'by breaking down and selectively looking at the needs of students and how to deliver intentionally and support students through a combination of learning styles (hybrid etc.)','working out hybrid teaching by implementing regular teaching and virtual',5,5,5,0,0,'the addressing of topics that needed to be looked at closely for optimal learning experience','nothing at this time',10,'this rating adequately describes the experience of this professional learning based on its objective and completion of its objective.','none at this time',6,32,0,10,0,'breakout rooms, on screen examples, charts'),(11442,1591156800,'Calcasieu Parish, LA','Teacher or specialist',5,5,5,5,4,4,'virtual learning','video recording',5,4,4,0,0,'talking to my teammates','more modeling',7,'it may be too advanced for some','no',6,32,0,10,0,'breakout sessions'),(11443,1