termining synchronous and asynchrous lessons',5,5,5,0,0,'The collaboration among colleagues','answered questions',7,'It would depend on the needs of the colleague','',6,32,0,10,0,'breakout sessions'),(11462,1591156800,'Calcasieu Parish, LA','Teacher or specialist',5,5,5,5,5,5,'All was great','Unpacking lessons do my unit',5,5,5,0,0,'Organization and technology','All went well',10,'Smooth','',6,32,0,10,0,'Collaboration'),(11463,1591156800,'Calcasieu Parish, LA','Teacher or specialist',5,5,5,5,5,4,'Collaborating with other teachers and the instructor to discuss what lessons could be taught asynchronously versus synchronously.','Tweaking the lessons to make them work for the situation we are facing.',4,5,5,0,0,'The breakout groups and collaboration with other teachers.','Nothing',10,'The presentations are helpful in guiding how Guidebooks should be taught and why the lessons are sequenced the way that they are.','Thank you!',6,32,0,10,0,'Discussions'),(11464,1591156800,'Calcasieu Parish, LA','Teacher or specialist',5,5,5,5,5,5,'Ideas for unpacking the unit','Understanding the lessons and sections and how they build knowledge, help prepare students for assessments',5,5,5,5,5,'Discussions and breakout groups','Nothing at this time',10,'Well prepared presenters and quality information','No',6,32,29,8,0,'All of them'),(11465,1591243200,'Fort Dodge Schools, IA','Teacher or specialist',5,5,4,5,5,4,'How materials can be transferred virtually.','Backwards planning and keeping the goals in mind as we go through each lesson. Also, implementing the supporting materials.',3,5,5,5,5,'The Zoom meetings went so well! I loved practicing what we learned and I thought the facilitators did a great job considering the circumstances.','Some mishaps with Moodle but out of all the times I\'ve used Moodle as a learning platform, this was the most smooth transition of material I\'ve ever experienced!',10,'This was just overall very helpful and I learned a lot.','Thank you!! :)',8,6,3,0,0,'Zoom meetings'),(11466,1591243200,'Fort Dodge Schools, IA','Teacher or specialist',3,5,3,3,5,2,'Another component to online learning, using a different platform and becoming more comfortable with Zoom.','Seeing how the scaffolds can be used within any lesson.',3,4,4,5,5,'I think them talking about the different components of the new curriculum. I felt like they handled the virtual component well. Everything was easy to understand and follow.','I would say almost every time we went into a break out room that was supposed to be grade specific, I was never with the people I would be teaching with. It did help with perspective, but we were never on common ground because what we would be teaching would be different.',4,'I think it was great to break it down, but I would\'ve liked to actually dive into the curriculum a little bit more. The breakout rooms weren\'t the most effective because we weren\'t with the right grades','I thought the facilitators were very helpful and very engaging throughout the bootcamp. They knew the curriculum and were willing to answer any questions we had. They also seemed very engaged when teaching and excited about the content.',8,6,3,0,0,'I think using the chat in Zoom to answer the questions that Justin and Tara posed. Everyone was allowed to share their ideas and then we could also see everyone else\'s ideas at the same time.'),(11467,1591243200,'Fort Dodge Schools, IA','Teacher or specialist',4,4,4,4,4,4,'Taking a deeper look at the curriculum and gaining a better understanding for it','All of it! I\'m excited about the scaffolds that are provided to use to meet the needs of all learners.',2,4,4,4,4,'Taking a deeper look into the curriculum through the provided work','Providing examples of all grade levels',8,'I felt the facilitators were knowledgeable in the content and able to help us grow in our learning','I wish it could have been in person because maybe there were more activities to help us dive deeper into our learning',8,6,3,0,0,'The posts, videos, reading, working with our exact curriculum'),(11468,1591243200,'Louisville School District - Jacob Elementary, KY','Teacher or specialist',2,4,2,3,2,3,'I don\'t think anything can help us really prepare for life after COVID-19 because we are not there and we do not yet know when we will get there. Having said that, this process has helped our school start to think about how we will start back up and consider the even greater gaps in learning students will come back with.','Helping students work together to tackle complex, engaging and relevant texts.',1,4,3,0,0,'Zoom meetings started and ended as on time. Sessions were supported through effective use of technology and facilitators were knowledgeable and helpful.','The Moodle platform was very glitchy on my chromebook. Some of the files would not open and it would not allow me to attach files when work was to be completed and submitted. Apparently it worked better on Windows machines. I feel it is very important in this age of technology to be sure things work across as many platforms as possible.',4,'I did not feel this was as effective as possible using the virtual platform. This is of course beyond anyone\'s control and not at all the responsibility of the presenters who, given the circumstances did an outstanding job. I would most likely have a different overall perspective of the training had we been able to meet in person.','',8,9,0,0,0,'Conversations with colleagues and message boards helped me understand how others were thinking and feeling about the content.'),(11469,1591243200,'Louisville School District - Jacob Elementary, KY','Teacher or specialist',4,4,4,4,5,4,'I\'m better prepared to teach remotely because the resources I need are available online.e','Just trying a new program',4,4,4,0,0,'The system was easy to navigate','Having textbooks',7,'Not sure about the program because it\'s new','',8,9,0,0,0,'All because this new');
